(1, 'TEST', '                                                                                    <meta name="viewport" content="width=device-width">                            <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">                            <title>Application Created Ref''.$invoiceid.''</title>                                                        \r\n                            \r\n                            \r\n                            <table style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; width: 100%; margin: 0; padding: 20px;"><tbody><tr style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"><td style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"></td>\r\n                            <td bgcolor="#FFFFFF" style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; display: block !important; max-width: 600px !important; clear: both !important; margin: 0 auto; padding: 20px; border: 1px solid #f0f0f0;">\r\n                            \r\n                            \r\n                            <div style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; max-width: 600px; display: block; margin: 0 auto; padding: 0;">\r\n                            <table style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; width: 100%; margin: 0; padding: 0;"><tbody><tr style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"><td style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;">\r\n                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;"><b>Dear {NAME}</b>,<br><b>Invoice ID :{INVOICE}</b></p>\r\n                            <p style="font-family: \\''Helvetica Neue\\'', Helvetica, Arial, \\''Lucida Grande\\'', sans-serif; font-size: 24px; line-height: 1.2; color: #000; font-weight: 200; margin: 40px 0 10px; padding: 0;">Thank you for choosing {BASEURL} online services</p>\r\n                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;">This is to confirm your Turkey Visa application has been successfully sent. We will be processing your visa application accordingly. </p><ul><li>To check the status of your application, you can sign in at our website {CHECKSTATUS}</li><li>Please check your email to confirm the information submitted is correct. In case you are not able to find the email from us in your inbox, please check the "Spam" or "Junk Mail" Folder.</li></ul><p></p>                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;">Please Print your invoice {INVOICELINK}</p>                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;">Check your application status from the below link {CHECKSTATUSLINK}</p>                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;">Please retain this e-mail for your records.                            </p><p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;font-style:italic">For assistance, please click here {CONTACTLINK}.</p>                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;"><b>Thank you very much for your patience.</b></p>                           <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;"><b>Kind Regards</b></p><p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.6; font-weight: normal; margin: 0 0 10px; padding: 0;"><strong>Best Regards,</strong><br>   <strong>Quick eVisa</strong><br>   24X7 Application support<br>   Tel : Toll Free - 0800 133 7619</p></td>                            \r\n                            </tr></tbody></table></div>\r\n                            \r\n                            \r\n                            </td>\r\n                            <td style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"></td>\r\n                            </tr></tbody></table><table style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; width: 100%; clear: both !important; margin: 0; padding: 0;"><tbody><tr style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"><td style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"></td>\r\n                            <td style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; display: block !important; max-width: 600px !important; clear: both !important; margin: 0 auto; padding: 0;">\r\n                            \r\n                            \r\n                            <div style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; max-width: 600px; display: block; margin: 0 auto; padding: 0;">\r\n                            <table style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; width: 100%; margin: 0; padding: 0;"><tbody><tr style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"><td align="center" style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;">\r\n                            <p style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 1.6; color: #666; font-weight: normal; margin: 0 0 10px; padding: 0;">                            {DATE} {SITENAME}.\r\n                            </p>\r\n                            </td>\r\n                            </tr></tbody></table></div>\r\n                            \r\n                            \r\n                            </td>\r\n                            <td style="font-family: \\''Helvetica Neue\\'', \\''Helvetica\\'', Helvetica, Arial, sans-serif; font-size: 100%; line-height: 1.6; margin: 0; padding: 0;"></td>\r\n                            </tr></tbody></table>                            ', '1', '1'),
