(14, 'Tarek Assaad', 'tarek_jwl@yahoo.com', 'turkisk visa', 'Hello,\ni applied for Turkish e-visa\nthe Paypal transaction 15N327787C615703A\nthe application number EV-54369F186851E\ni would like to know how to download the application and how to get the visa\nTarek\nthanks ', '83.110.240.208', '2014', '', '', ''),
