(31, 'Mohammad Ishaq Sajid', 'samundargermany@hotmail.com', 'Info ', 'I am living here from 23 years I have German nationalty   my childrens have also Germany passport \n only my wife still Pakistani passport   we wanted to visit Tuky  in April 2015 for one week  is it posible visa for my wife  I and my 2 Kids Age 11 year and 7 yers , both go to School.   please write me about info about visa  I shall bi thanks full you thanks all --waiting ', '89.14.108.166', '2015-01-09 11:15:41', '1', '', ''),
