(38, 'YASEEN', 'yasasay@hotmail.com', 'We shared your family Turkey Visa to your email', 'Dear Yaseen,<br><br>We would like to inform you we shared your family Turkey Visa to your email few hrs before.<br><br><b>In case you are not able to find the email from us in your inbox, please check the "Spam" or "Junk Mail" folder.</b>\r\n						\r\n <span>For assistance, please click here <a rel="" target="_blank" href="https://turkeyvisapro.com/index.php/contact">https://turkeyvisapro.com/index.php/contact</a>.</span>\r\n\r\n <b><br><br>Kind Regards</b><span><b>Director</b><br><b>Visa Solution - Ticketing - Accommodation - Touring - Transportation</b>,<br>Turkey Visa Pro<br>3-5 Excelsior House Balfour Road, Ilford, Essex IG1 4HP<br>Tel : Toll Free - 0800 133 7567</span><br><br>', '', '2015-01-11 15:41:33', '1', '1', '358'),
