(431, '', 'Ordinary Passport', '30.01.2015', '', '', '', '', '????', '??????', '02.02.1959', '??????', '?????', '????', '003542099', '19.02.2013', '18.02.2018', '', 'asoma118@yahoo.com', '99036691', '???????? ???? 1\n???? 15 \n???? 6', '', '', '', '', 'C', '2015-01-20 11:20:08', '0', '93', 'TR_EVisa_165968890749(1).pdf', 'EV-54BE39E4E608E', '', '', '', '', '1', '', '1', '1', '193.108.30.11', 'Kuwait,Al Kuwayt,KW-', 'AS47519 Kuwait Ministry of Defense', 'I spoke to the client and took the following details:<br><br>First Name: Mariam<br><br>Surname: Ahmad<br><br>Place of Birth: Kuwait<br><br>Date of Birth: 18-02-1959<br><br>Mother Name:Khdiza<br><br>Father name: Ahmad<br><br>Address: Kaldiua Street, 15, Block 1. Kuwait<br><br>Your date of Travel to turkey:30-01-2015<br><br><br><br><br><br>Email sent via pay pal on 29th January 2015<br><br>\r\n\r\nDear Asma Alwasmi,\r\n\r\nOn 20th January you made\r\napplication for the Turkish e-visa, your application received with incomplete\r\ninformation. Our service team called you and collected the right information. We\r\nhave sent you an email to confirm the information we have taken from you over\r\nphone to make sure it is correct. We complted your application with the given\r\ninformation and sent you the visa to the registered email id of yours\r\n(asoma118@yahoo.com)\r\n\r\nAfter seeing the Dispute\r\n(PP-003-686-915-777) generated from Paypal, we have once again sent you the\r\nvisa to the above email id. Itâ€™s highly important that we will not send your\r\nvisa to any other email id apart from the one you have used to apply for. I\r\nhave also called in this regard and spoke to you, you have told me you have\r\napplied the visa from different service provided and got yourself and you do\r\nnot need our service anymore.\r\n\r\nAs per the terms the refund is\r\nissued in case your application is declined. In your case we have already\r\nissued your visa.\r\n\r\nHowever considering your case the\r\namount work done from our side, we would like to ask you to accept to consider\r\n50% refund, could you please confirm if that ok for you? This is very special\r\ncase we would like to consider as the already the service has been completed.\r\n\r\nWe wish you good luck with the\r\nJourney. Please confirm soon as you can.\r\n\r\nKind regards,\r\n\r\nDirector\r\n\r\nVisa Pro\r\n\r\n&nbsp;\r\n\r\n<br><br>', '', '', '', '', '', '', '', '', ''),
