INSERT INTO `email_templates` (`id`, `templatename`, `templateData`, `status`, `users`) VALUES
(5, 'Turkey eVisa - Paying via Paypal without a PayPal account', '<div>Dear {NAME},<b><br><br>Congratulations for successfully </b>submitting your Turkey e-Visa application, registration has now been done.<b><br><br></b>Application Reference Number: {INVOICEID}<b><br><br></b></div><div><b>Please note:</b> If you find difficulty in making payment using <b>"Debit Card" alternatively use "Credit Card"</b>. <b>Please ignore if already paid.</b></div><br><b>Payment Link: </b>{PAYMENTLINK}<br><br><div>In<b> the case of </b>your Credit / Debit card being declined, it might be helpful to complete the transaction:<br><a href="https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA" target="" rel="">https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA</a><br><br>if you have any further questions, please feel free to contact us via <a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow"> </a><br></div>', '1', '1'),
(26, 'Turkey eVisa - Unable to Locate Information', '<div>Dear <b>{NAME},</b></div><div><br></div><div>Thank you for contacting <b>turkeyevisa.online</b>&nbsp;support team.<br></div><div><br></div><div>turkeyevisa.online searched our data base using your email id which you have used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1.&nbsp;<b>Turkeyevisa.online&nbsp;reference number</b>: whilst applying for using turkeyevisa.online e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our 15 digits reference number normally start with <b>(QV-XXXXXXXXXXXXX) in the front.</b></div><div><br></div><div>2. In addition to that reference number you can also provide us with your<b> passport number</b> you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the<b> email id used whilst applying</b> for the service.</div><div><br></div><div>4. <b>Payment confirmation</b> which has been confirmed by Turkeyevisa.online</div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.</div>', '1', '1'),
(27, 'Turkey eVisa - Your record is not held on our system', '<div>Dear {NAME},<b><br><br></b></div><div>Thank you for contacting<b> </b>Turkeyevisa.online</div><div><br></div><div>We are sorry that we are unable to help you at this point in time, your record is not held on our system, and we have to conclude that you never applied via Turkeyevisa.online.</div><div><br></div><div>Thank you for contacting us.</div>', '1', '1'),
(28, 'Turkey eVisa - you have processed your visa from different website', '<div>Dear {NAME},</div><div><br></div><div>Thank you for contacting Turkeyevisa.online</div><div><br></div><div>We are sorry that we are unable to help you at this point in time, your record is not held on our system, and we have to conclude that you never applied via turkeyevisa.online.</div><div><br></div><div>Please be noted from that email you have just sent to us now, we can note that you have processed your visa from different website xxxxxxxxx (this I the site information given by customer as reference for refund or cancelation or enquiry) and this website does not belong to us. I kindly suggest you to contact them directly and ask for clarification/refund/Cancelation.</div><div><br></div><div>We hope we have done our best to support you at this occasion.</div><div><br></div><div>Thank you for contacting us.</div><div><br></div><div><br></div>', '1', '1'),
(29, 'Turkey eVisa - Some information missing to process your eVisa', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: {INVOICEID}</div><div><br></div><div>Please be advised that Turkeyevisa.online is pending update from you in line with XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX please can you check and confirm to us.</div><div><br></div><div><span>Please kindly reply back to us via <code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> quoting\r\nyour reference number.</span></div><div><br></div><div>Please note: you donâ€™t have to make fresh application; your email confirmation of the changes will be added to the application with your full authorization.</div><div><br></div>', '1', '1'),
(30, 'Turkey eVisa -  Your arrival date should be within 3 months', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: {INVOICEID}</div><div><br></div><div>Please be advised that Turkeyevisa.online is pending update from you in line with&nbsp;<b>Your arrival date</b>. It&nbsp;should be&nbsp;<b>within 3 months</b>&nbsp;as of the date of an e-Visa application.&nbsp;please can you please&nbsp;<b>change the travel date and&nbsp;confirm to us.</b></div><div><br></div><div><span>Please kindly reply back to us via&nbsp;<code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code>&nbsp;quoting your reference number.</span></div><div><br></div><div>Please note: you do not have to make fresh application; your email confirmation of the changes will be added to the application with your full authorization.</div><br>', '1', '1'),
(31, 'General enquiry asking for eligibility', '<div>Dear {NAME},</div><div><br></div><div>Hope you are having nice day.</div><div><br></div><div>Thank you for contacting us.</div><div><br></div><div>To check your eligibility please make application following this link, the application process is designed to check your eligibility. <code><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">http://turkeyevisa.online/application</a></code><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">&nbsp;</a></div><div><br></div><div>For the fee and other information please visit <a href="http://turkeyevisa.online/visa-fees" target="" rel=""></a><a href="https://www.turkeyevisa.online/index.php/visa-fees" target="_blank" rel="nofollow">http://turkeyevisa.online/visa-fees</a><a href="https://www.turkeyevisa.online/index.php/visa-fees" target="_blank" rel="nofollow">&nbsp;</a></div><div><br></div><div>If you wish to contact us, please do not reply to this message but instead go to <code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code></div><div><br></div>', '1', '1'),
(32, 'Turkey eVisa - Some information required to process your eVisa', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Please be advised that Turkeyevisa.online is pending update from you in line with XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX please can you check and confirm to us.</div><div><br></div><div>If you are looking for more help or have a question to ask click here and share <a href="https://turkeyevisa.online/contact-us" target="" rel=""></a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_self" rel="">https://turkeyevisa.online/contact-us</a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_self" rel=""> </a>quoting your reference number and the name.</div><div><br></div><div>Please note: you do not have to make fresh application; your email confirmation of the changes will be added to the application with your full authorization.</div><div><br></div>', '1', '1'),
(33, 'Turkey eVisa - Passport related information missing to process your eVisa', '<div>Dear {NAME},&nbsp;</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: <b>{INVOICEID}</b></div><div><br></div><div>Please be advised that Turkeyevisa.online is pending update from you in line with XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX&nbsp;</div><div>please can you check and confirm to us.</div><div><br></div><div>If you are looking for more help or have a question to ask click here and share <code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> quoting your reference number and the name.</div><div><br></div><div>Please note: you do not have to make fresh application, your email confirmation of the changes will be added to the application with your full authorization.</div><div><br></div>', '1', '1'),
(34, 'Turkey eVisa - Amount refunded due to Passport related error', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: <b>{INVOICEID}</b></div><div>Please be advised that Turkeyevisa.online unable process your application XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX</div><div>&nbsp;Kindly re-apply with your renewed passport we should be able process your application.</div><div><br></div><div>We have already allocated you the refund back to you.<br><br>Please note that the refund will be allocated via PayPal account in which you created, to access your refund please return to your PayPal personal account and make a withdrawal request.<br></div><div><br></div><div>Thank you for utilizing of eVisa application service.</div><div><br></div><div>As soon as you obtain the new passport you can make application by following this link<b> </b><code><b><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">http://turkeyevisa.online/application</a></b></code></div><div><br></div><br>', '1', '1'),
(35, 'Turkey eVisa - Your refund as requested', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Please be advised that Turkeyevisa.online received your refund request, we have escalated to the refund processing department, and you should get a confirmation email noting the refund within 24 hours.</div><div><br></div><div>In the meantime, should you change your mind please do not hesitate to contact us via <a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a> quoting your reference number and the name. And confirm that you wish to go ahead with the process otherwise the refund will be processed automatically,</div><div><br></div><div>Please note: you do not have to worry, the refund will be actioned promptly. &nbsp;We always seek to ensure that our customers are looked after on time.</div><div><br></div>', '1', '1'),
(36, 'Turkey eVisa - Your refund', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Please be advised that Turkeyevisa.online received your refund request, your eVisa has already been sent to your email.</div><div><br></div><div>Just in case you did not receive any email, you are kindly requested to check your spam folder.</div><div><br></div><div>However to save time, please follow the below secured and encrypted link to download your e-Visa directly.</div><div><br></div><div>{DOWNLOADLINK}</div><div><br></div><div>Please note: Once the e-visa has been processed the refund is not possible as per the Turkish Government policy, there is no refund once the e-visa has been issued/allocated via email. For more information please follow the terms and conditions link published on our website. <code><a href="https://www.turkeyevisa.online/index.php/terms" target="_blank" rel="nofollow">http://turkeyevisa.online/terms</a></code></div><div><br></div><div>However, if you are not happy with the service provided, at Turkeyevisa.online we value every customer , hence &nbsp;we do consider requests for partial refunds covering &nbsp;our service charge under special circumstances, &nbsp;we deduct 20% of our service charge fee to cover admin / support costs and the actual government application fee, the rest can be refunded.</div><div><br></div><div>Please confirm this arrangement is ok for you as special consideration towards your case, the refund request will be escalated with our refund department and will be actioned in next 24 hours.&nbsp;</div><div><br></div><div>If we donâ€™t receive any confirmation from you we assume that you are happy with our service and the terms, as a result of this no refund will be actioned and the request will be closed.</div><div><br></div><div>Thank you for wishing to utilize our services, we are looking forward to hearing from you.</div><div><br></div>', '1', '1'),
(37, 'Turkey eVisa - Download Your Turkey eVisa', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Your eVisa has already been sent to your email.</div><div><br></div><div>Just in case you did not receive any email, you are kindly requested to check your spam folder.</div><div><br></div><div>However to save time, please follow the below secured and encrypted link to download your e-Visa directly.</div><div><br></div><div><b>{DOWNLOADLINK}</b></div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Turkeyevisa.online in case you have lost your copy, please feel free to contact us via <code><a target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> quoting your reference number and the name, we should be able to retrieve a copy and send out to you within 24 hours.</div><div><br></div><div>We wish you a safe onward journey; enjoy your visit to Turkey</div><div><br></div>', '1', '1'),
(38, 'Turkey eVisa - Please confirm your email id', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Your eVisa has already been sent to your email.</div><div><br></div><div>Unfortunately the email has bounced back. The email id we have in our record is xxxxxxxxxxxxxx@zxxx.com</div><div><br></div><div>Please reply back to this email with an appropriate / correct email ID, in order for TurkeyeVisa to send your eVisa copy.&nbsp;</div><div><br></div><div>Please note due to standards in accordance with the Data Protection Act, we will not be sending a copy of your eVisa to another person on your behalf, unless you send us the new email confirmation and authorisation statement outlining permission to do so.</div><div><br></div><div>We can alternatively send you a copy of your eVisa by mail order, to the given address (paste the address son the record)</div><div><br></div><div>Please kindly reply back to us via <code><a href="https://turkeyevisa.online/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> quoting your reference number</div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you.</div><div><br></div>', '1', '1'),
(39, 'Turkey eVisa â€“ Mail Confirmed', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br>Please follow the below\r\nsecured and encrypted link to download your e-Visa directly.</div><div><br></div><div><b>{DOWNLOADLINK}</b></div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Turkeyevisa.online in case you have lost your copy, please feel free to contact us via <code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> quoting your reference number, we should be able to retrieve a copy and send it across to you within 24 hours.</div><div><br></div><div>We wish you a safe onward journey; enjoy your visit to Turkey.</div><div><br></div>', '1', '1'),
(40, 'Turkey eVisa -Your refund initiated and We are requesting to remove the dispute', '<div>Dear {NAME},</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Kindly remove the dispute from the papal as we already agree to do partial refund as per the terms and condition. Soon as you remove resolve the dispute form your side, we will get alert from Papal so that we can immediately action your refund. Your support is much appreciated in this regard.</div><div><br></div><div><br></div><div>Please download your visa following this link below:</div><div><br></div><div><b>{DOWNLOADLINK}</b></div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Turkeyevisa.online in case you have lost your copy, please feel free to contact us via <a href="https://turkeyevisa.online/contact-us" target="" rel=""></a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow"> </a>quoting your reference number, we should be able to retrieve a copy and send out to you within 24 hours.</div><div><br></div><div>We wish you a safe onward journey, enjoy your visit to Turkey.</div><div><br></div>', '1', '1'),
(41, 'Turkey eVisa -Your full refund initiated and We are requesting you to remove the dispute', '<div>Dear {NAME},<br><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> {INVOICEID}</b></div><div><br></div><div>Kindly remove the dispute from the papal as we already agree to do full refund as a special case under description of the our terms and condition. Soon as you remove resolve the dispute form your side, we will get alert from Papal so that we can immediately action your refund. &nbsp;Your support is much appreciated in this regard.</div><div><br></div><div>On special gesture we have incurred the cost of your eVisa application fee which is already paid to process your eVisa. We take pride in satisfying our customer as much as we can.</div><div><br></div><div>Since your eVisa is already successfully processed and it available for you to use, you donâ€™t have to apply once again.</div><div><br></div><div>Please download your visa following this link below:</div><div><br></div><div><b>{DOWNLOADLINK}</b></div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Turkeyevisa.online in case you have lost your copy, please feel free to contact us via <a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow"> </a>&nbsp;quoting your reference number, we should be able to retrieve a copy and send out to you within 24 hours.</div><div><br></div><div>We wish you a safe onward journey, enjoy your visit to Turkey.</div><div><br></div>', '1', '1'),
(42, 'Turkey eVisa - Applied for visa incorrect Information, Visa issues, Customer asking to rectify- Giving free visa ', '<div>Dear {NAME},&nbsp;</div><div><br></div><div>Thank you for the email.</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: {INVOICEID}</div><div><br></div><div><br></div><div>Your eVisa has been processed based on the information provided by you.</div><div><br></div><div>We understand now that there was an error committed by you while making application at turkeyevisa.online. Itâ€™s also been noted that your visa arrival date is XXXXXXXXXXXXX</div><div><br></div><div>once the eVisa required change, we will not be able to do the amendments once it is issued. So itâ€™s important that correct information provided at the time of making application at turkeyevisa.online</div><div><br></div><div>we can fix it:&nbsp;</div><div><br></div><div>The only way to rectify the XXXXXXXXX by following the link <code><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">http://turkeyevisa.online/application</a></code><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">.</a></div><div><br></div><div>While making application you have to make new arrival date. This depends if you have already arrived to Turkey, itâ€™s better to take advice from the officials.</div><div><br></div><div>Normally as per our terms and conditions, any fresh application made, payment required to be paid to process the application.&nbsp;</div><div><br></div><div>However we are happy to give special support for you, so you donâ€™t have to pay for it again, and we will process it free of charge and send you a new visa. &nbsp;So while making fresh application for {INVOICEID}, please click to pay and after than you can leave it there without making payment.</div><div><br></div><div>Once applied please contact us via email, we will action it for you.</div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at turkeyevisa.online in case you have lost your copy, please feel free to contact us via&nbsp;<code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code>&nbsp;&nbsp;quoting your reference number, we should be able to retrieve a copy and send out to you within 24 hours.</div><div><br></div><div>We wish you a safe onward journey; enjoy your visit to Turkey.</div><div><br></div>', '1', '1'),
(43, 'EDIT : Turkey eVisa - Applied for visa incorrect Information, Visa issues, Customer asking to rectify- Not giving free Visa. Customer need to pay again ', 'Dear&nbsp;{NAME},<span><br>\r\nThank you for the email.<br>\r\n<br>\r\nI hope that this email finds you having a nice day.<br>\r\n<br>\r\nYour application reference number:&nbsp;</span><span>{INVOICEID}<br></span><span><br>Your visa has been issued based on the information provided by you.<br>\r\n<br>\r\nWe understand now that there was an error committed by you while making\r\napplication at&nbsp;</span>Turkeyevisa.online Itâ€™s also been noted that your visa arrival date\r\nis 27.08.2015.<span><br>\r\n<br>\r\nOnce the visa issues, we cannot do the amendments. So itâ€™s important that\r\ncorrect information provided at the time of making application at&nbsp;</span>Turkeyevisa.online<span><span><br>\r\n<br>\r\nWe can fix it:<br>\r\n<br>\r\nThe only way to rectify the name to CORRECTE NAME :\r\nAMRO KHALID BAGEDO, you have to make fresh application for AMRO KHALID BAGEDO by\r\nfollowing the link </span><a href="http://turkeyevisa.online/application" target="" rel=""></a><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">http://turkeyevisa.online/application</a><span><a href="https://www.turkeyevisa.online/index.php/application" target="_blank" rel="nofollow">.</a><br>\r\n<br>\r\nWhile making application you have to make new arrival date. This depends if you\r\nhave already arrived to Turkey, itâ€™s better to take advice from the officials.<br>\r\n<br>\r\nNormally as per our terms and conditions, any fresh application made, payment\r\nrequired to be paid to process the application. <br>\r\n<br>\r\nHowever we are happy to give special support for you, so you donâ€™t have to pay\r\nfor it again for our service charge, and we will process it free of charge and\r\nsend you a new visa.&nbsp; So while making fresh application for AMRO KHALID BAGEDO, please click to pay and make\r\npayment as it is given including the service charge. As soon as we receive the\r\npayment, we will refund your service charge and will only charge you for the\r\nofficial visa fee.<br>\r\n<br>\r\nOnce applied please contact us via email, we will action it for you.<br>\r\n<br>\r\nThank you for selecting our e-application support service, we would be very\r\nhappy to serve you again in the near future.<br>\r\n<br>\r\nYour copy of eVisa will be held within a secured system at Turkeyevisa.online&nbsp;in\r\ncase you have lost your copy, please feel free to contact us via </span><code><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code><span> quoting your reference number, we should be able to\r\nretrieve a copy and send out to you within 24 hours.<br>\r\n<br>\r\nWe wish you a safe onward journey, enjoy your visit to Turkey.</span></span>', '1', '1'),
(44, 'EDIT : Turkey eVisa - Client accepted offer but Asking for change to all the application to re issue eVisa ', '<div>Dear&nbsp;{NAME}&nbsp;</div><div><br></div><div>Thank you for contacting us again.</div><div><br></div><div>Old Application Reference: QV-55DAC29713048</div><div>New Application Reference:&nbsp;,{INVOICEID}&nbsp;</div><div><br></div><div>It is also noted that you have applied with new Arrival date for both 20.09.2015</div><div><br></div><div>Please be noted that previously issued visa for Mr KHALID AHMED B BAGEDO, Passport Number: L680720is &nbsp;valid, &nbsp;itâ€™s not compulsory that he must travel on the arrival date mentioned on his visa which is 27.08.2015. &nbsp;Mr KHALID AHMED B BAGEDO, can use his existing eVisa to travel within his validity period which is 22 February 2016.( this date available at the eVisa &nbsp;which is issued)</div><div><br></div><div><br></div><div>As we have mentioned in the previous email, we are happy to issue new eVisa for AMRO KHALID A &nbsp;BAGEDO, Passport Number K653588. He will have is validity starting from 20 September 2015.</div><div><br></div><div>Kindly confirm this email, we will go ahead and issue new eVisa for Mr AMRO KHALID A &nbsp;BAGEDO, Passport Number K653588. &nbsp;We will do this process free of charge as we have offered in our previous email.</div><div><br></div>', '1', '1'),
(45, 'EDIT : Turkey eVisa - Client Applied with minor error asking for change. Advising the client to travel with the same visa ', '<div>Dear {NAME},</div><div><br></div><div>Thank you for the email.&nbsp;</div><div><br></div><div>I hope that this email finds you having a nice day. &nbsp;</div><div><br></div><div>Your application reference number:&nbsp;{INVOICEID}</div><div><br></div><div>You have applied e-Visa for:&nbsp;</div><div><br></div><div>1. Juan Sergio Gherrero, Passport Number: QE483295, Arrival Date: 01.11.2015 (The name mentioned here as we have received at the initial application)&nbsp;</div><div><br></div><div>2. Maria Clara Gherrero, Passport Number: QE326119, Arrival Date: 01.11.2015 (The name mentioned here as we have received at the initial application)</div><div><br></div><div>Your visa has been issued based on the information provided by you. We understand now that there was a very minor typo error from you while making the application at Turkeyevisa.online.</div><div><br></div><div>Once the visa issued, we cannot do the amendments as its issued by the Turkish government itself. So it is important that correct information are provided at the time of making application at Turkeyevisa.online.</div><div><br></div><div>Any change in the eVisa, will be of a fresh application paying the actual eVisa official fee, however we can do the processing fee as free charge for you, but the official eVisa fee of USD 60 for each candidate has to be paid again.&nbsp;</div><div><br></div><div>But we recommend that there is no need to re-apply for new eVisa as the errors are very minor, it can be considered as typographical error. So you do not have to worry about this. At the port of entry you can clarify this as typo error happened while applying, alternatively you can also avail the felicity while you are the Airport at Turkey.</div><div><br></div><div>So please do not make any fresh application and make payment again, you can use your existing eVisa and travel with peace. If asked at the port of entry, please clarify it as typo error and show your identification as and when required.&nbsp;</div><div><br></div><div>Now you we have received correct spelling from your side via email:&nbsp;</div><div><br></div><div>Maria Clara Guerrero - (we noted &nbsp;its u instead of h at the surname)</div><div>Juan Sergio Guerrero - (we noted &nbsp;its u instead of h at the surname)</div><div><br></div><div>we have noted this on our record.&nbsp;</div><div><br></div><div>Should you require any further support please do not hesitate to contact us anytime.we have 24X7 email support to make sure your journey is peaceful and enjoyable.</div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future. &nbsp;</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Turkeyevisa.online in case you have lost your copy, please feel free to contact us <code><a href="https://turkeyevisa.online/contact-us" target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> quoting your reference number, we should be able to retrieve a copy and send out to&nbsp;</div><div>you within 24 hours.&nbsp;</div><div><br></div><div>We wish you a safe onward journey, enjoy your visit to Turkey.</div><div><br></div>', '1', '1'),
(46, 'EDIT : Turkey eVisa - Client made two application and paid, canceling on which is not required/ or the refund request made by the client to Refund ', '<div>Dear {NAME},</div><div><br></div><div>It was nice speaking with you over the phone.</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: {INVOICEID}</div><div><br></div><div>Please be advised that Turkeyevisa.online&nbsp;received your refund request, as per the telephonic conversation we have already submitted the refund for this application {INVOICEID}</div><div><br></div><div>For the additional application {INVOICEID} which you have made, please be advised that it has successfully been processed and the e-Visa is available to download from the below link.</div><div><br></div><div>{DOWNLOADLINK}</div><div><br></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Turkeyevisa.online in case you have lost your copy, please feel free to contact us via <a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">https://</a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">t</a><a href="https://quickevisa.com/contact-us" target="" rel=""></a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">urkeyevisa.online/contact-us</a><a href="https://www.turkeyevisa.online/index.php/contact-us" target="_blank" rel="nofollow">&nbsp;</a>&nbsp;quoting your reference number, we should be able to retrieve a copy and send it across to you within 24 hours.</div><div><br></div><div>We wish you a safe onward journey; enjoy your visit to Turkey.</div><div><br></div>', '1', '1'),
(47, 'Turkey eVisa - Asking for requirement confirmation. This email for the client who skipped to the application process: ', '<div>Dear {NAME},</div><div><br></div><div>Your Turkey e-Visa application reference number: {INVOICEID}</div><div><br></div><div>Unfortunately the Turkey Embassy has changed its rules for Liberia Nationality, a valid supporting document such as a "Visa" or "residence" from any of the OECD member countries listed below.</div><div><br></div><div>Permit of a Schengen or OECD country as mentioned in the list below.</div><div><br></div><div>Visa supporting document:</div><div><br></div><div>&nbsp; &nbsp; Australia</div><div>&nbsp; &nbsp; Canada</div><div>&nbsp; &nbsp; Chile</div><div>&nbsp; &nbsp; Ireland</div><div>&nbsp; &nbsp; Israel</div><div>&nbsp; &nbsp; Japan</div><div>&nbsp; &nbsp; Korea, Republic of</div><div>&nbsp; &nbsp; Mexico</div><div>&nbsp; &nbsp; New Zealand</div><div>&nbsp; &nbsp; Schengen</div><div>&nbsp; &nbsp; U.S.A</div><div>&nbsp; &nbsp; United Kingdom</div><div><br></div><div>Residency supporting document:</div><div><br></div><div>Belgium</div><div>Canada</div><div>Chile</div><div>Czech Republic</div><div>Denmark</div><div>Estonia</div><div>Finland</div><div>France</div><div>Germany</div><div>Greece</div><div>Hungary</div><div>Iceland</div><div>Ireland</div><div>Israel</div><div>Italy</div><div>Japan</div><div>Korea, Republic of</div><div>Latvia</div><div>Liechtenstein</div><div>Lithuania</div><div>Luxembourg</div><div>Malta</div><div>Mexico</div><div>Netherlands</div><div>New Zealand</div><div>Norway</div><div>Poland</div><div>Portugal</div><div>Schengen</div><div>Slovakia</div><div>Slovenia</div><div>Spain</div><div>Sweden</div><div>Switzerland</div><div>U.S.A</div><div>United Kingdom</div><div><br></div><div>There must be a period of six months validity on the supporting documents allocated.</div><div><br></div><div>Itâ€™s necessary to have a round-trip ticket with Turkish Airlines, Pegasus Airlines or Onur Air.</div><div><br></div><div>Please provide Turkeyevisa.online an update via <code><a target="_blank" rel="nofollow">https://turkeyevisa.online/contact-us</a></code> in order for your application to be further processed.</div><div><br></div><div>In summary to recap you must meet the following conditions:</div><div>You must meet all the requirements listed below in order to obtain an e-Visa. If you do not meet any of these requirements and you proceed with your application, your e-Visa will be invalid.</div><div><br></div><div>I have a round-trip ticket with Turkish Airlines, Pegasus Airlines or Onur Air.</div><div><br></div><div>I am travelling for the purposes of tourism or business.</div><div><br></div><div>I hold a valid supporting document (Schengen visa or a valid visa from any of the OECD member countries; or a valid residence permit of a Schengen or OECD country). e-Visas are not accepted as a supporting document.</div><div><br></div><div>I can prove that I hold a return ticket, hotel reservation and at least 50 $ per each day of my stay.</div><div><br></div><div>I hold a passport valid for at least 6 months from the date I intend to enter Turkey.</div><div><br></div><div>I confirm that I meet each and every one of the conditions listed above.</div><div><br></div>', '1', '1'),
(48, '', '', '1', '0'),
(49, 'Bad Review writing', 'Dear {NAME}. Thank you for writing a review. I want to address your concern about us charging a service fee for processing your visa. Our company processes visas for countries all across the globe. We are a travel agency that started the business because governments built poor websites and our clients were frustrated. <br><br>Our value proposition is: <br><br>1) Save you time and frustration<br>2) Provide 24/7 chat and phone support <br>3) Mobile friendly experience <br>4) Accept all forms of payment including PayPal and Amex <br>5) Accept multi-currencies <br>6) Easy visa retrieval process <br>7) Allow you to easily process more than 1 application at a time <br>8) Provide language translation of our website <br>9) Lowest service fee of private visa processors. <br><br>On our website, we have several disclaimers about the service In addition, during the checkout process the service fee is detailed. That being said, we aim to provide 100% customer satisfaction. We feel our service is a fair proposition.<br><br>', '1', '0');
