(4, 'zaynab', 'zaynab_m88@yahoo.com', 'prblem', 'hi\ni have a problem with paypal \nit say error detected\nhow can i fix it?\n\nbest regards', '130.193.206.192', '2014', '1', '', ''),
(5, 'alsulaiman', 'nfdtl@yahoo.com', 'where is my docs', 'hello sir, I have applied for visa to join turkey next month\nbut never recieved actual visa and revcvd email - the email asked payment.\n\n(sub : Application Created for REF:TV54338434959a4)\nplease send me mine then I plan to apply for my family.', '37.130.227.133', '2014', '1', '', ''),
(6, 'hameed', 'hameed.yildiz@yahoo.com', 'elictronic visa for turkia ', 'i want to get an elictronic visa for turkey', '130.193.154.186', '2014', '1', '', ''),
(7, 'jean grice ', 'jg47@hotmail.co.uk', 'turkish visa ', 'can you please tell me how much this visa will cost me ', '86.5.37.167', '2014', '1', '', ''),
(8, 'Van Gool Robert', 'bob.vangool@telenet.be', 'Evisa applicatie', 'Voor mijn E visa applicatie dien ik een paspoort nummer in te vullen. Daar ik enkel mijn Identiteit kaart wenst tel gebruiken , heb ik steeds het nummer van mijn Belgishe identitieitskaart trachten in te voerenvoeren ,maar werd steeds geweigerd', '94.226.251.4', '2014', '1', '', ''),
(9, 'Van Gool ', 'bob.vangool@telenet.be', 'Evisa aanvraag met ID card', 'Evisa aanvraag met ID card word steeds geweigerd', '94.226.251.4', '2014', '1', '', ''),
(10, 'William Moyersoen', 'william.moyersoen@telenet.be', 'ID Card', 'As a beligian citizen can I apply for a eVisa with my Belgian ID card instead of my passport?', '84.197.35.63', '2014', '1', '', ''),
(11, 'Margaret Brindle', 'meg.brindle@gmail.com', 'Time allotment for receiving e-visa', 'Hello,\nWe are leaving for Turkey in about 2 weeks.  I assume the e-visa is fast, but can you confirm?\n\nAlso, we travel frequently, ages 59-64, 2 people, can you tell me the cost for 2 visas?  thanks', '72.28.252.65', '2014', '1', '', ''),
(12, 'Aiman Ktesh', 'kaiman_sy@hotmail.com', 'Visit Visa', 'Hi\nI''m Syrian and my waif is Jordanian do we need visit visa for Istanbul Tourism  ??', '83.110.232.145', '2014', '1', '', ''),
(13, 'Nagesh', 'nageshgadde@gmail.com', 'Need o know the prcess', 'Hi i want to know the procsss let me know so that i can take a look to take ue serveces ASAP.', '203.217.147.74', '2014', '1', '', ''),
(14, 'Tarek Assaad', 'tarek_jwl@yahoo.com', 'turkisk visa', 'Hello,\ni applied for Turkish e-visa\nthe Paypal transaction 15N327787C615703A\nthe application number EV-54369F186851E\ni would like to know how to download the application and how to get the visa\nTarek\nthanks ', '83.110.240.208', '2014', '1', '', ''),
(15, 'Tarek Assaad', 'tarek_jwl@yahoo.com', 'turkisk visa', 'Hello,\n\nplease i applied for the visa online and paid by PayPal\nplease i want to know how to receive the visa and i want to call the customer service\nthanks', '83.110.240.208', '2014', '1', '', ''),
(16, 'Mohammad', 'm-hm-55@hotmail.com', 'wife and kids in one passport', 'dear sir,\n\nmy wife and kids are in one passport,\ni want to get a tourism visa for them using the online service,\n\nhow can i apply for a visa for that case?\n\nyour cooperation is appreciated', '87.109.26.109', '2014', '1', '', ''),
(17, 'Mohammed', 'mlz648@hotmail.com', 'money refund', 'dear sir,\ni have applied for a visa through your website; and you have charged me an amount of $90 and the paypal is showing that there is a deduction of this amount under your name.\ni am not interesting any more to apply \ncan you please refund the amount if possible?\nanyhow, your site is showing it is bending while the paypal is showing it already baid\nInvoice ID: EV-543B002790F75\n\nyour cooperation is appreciated', '87.109.26.109', '2014', '1', '', ''),
(18, 'Hayley Vallender', 'hayley.vallender@honeywell.com', 'When and how will I receive my Turkish Visa', 'I have applied for a Turkish Visa online ref EV-543B66410F62C. I understand that it takes 48 hours to receive the visa.\n\nPlease can you let me know if the visa is emailed to me?', '199.64.72.252', '2014', '1', '', ''),
(19, 'waleed', 'haertscreem@yahoo.com', 'URGENT', 'Application Created for REF:EV-543B7CFBB837B\nHi sory for  mistake \nMy passport expiry is 19/4/2019\ndate of issue 12/6/2014 .\n\n', '87.109.83.189', '2014', '1', '', ''),
(20, 'Hayley Vallender', 'hayley.vallender@honeywell.com', 'EV-543B66410F62C', 'I cannot seem to download my visa. Please download it and email me a copy.\n\nThanks ', '199.64.72.252', '2014', '1', '', ''),
(21, 'Gwilym.  Williams', 'gwilymWilliams@hotmail.co.uk', 'e visa', 'Could you please confirm that my application is being processed and when should I receive it. Telephone no . 07833577328 if you need any further information.\nThank you\nGwilym Williams', '81.158.7.30', '2014', '1', '', ''),
