(29, 'Ahmet Sami', 'wamclan2002@gmail.com', 'Palestinian Visa', 'Dear Sir/Madam\nI am Holding a Palestinian Passport (5 years passport) and I am living in United Arab Emirates with a valid visa.\ni could not find any option to select my country in first page of Turkish Application Form.\nAre you not giving visa for Palestinian.\nregards,\nAhmet', '86.99.107.150', '2015-01-07 16:26:49', '1', '', ''),
