(83, 'Sana Abu Khalil', 'shana.abukhalil@gmail.com', 'Multi Touristic Visa', 'To whom it may concern,\n\nI hold a Ukrainian Passport. I had a 3 months Student visa for Turkey. I''ve applied for the residency permit that usually takes up to 2 months to get it. During this time, i had a permission to leave Turkey for maximum 15 days since i still didn''t get my residency permit ID.\n\nI have over stayed by one day in Ukraine due to getting my new Ukrainian passport in Ukraine and had to pay a fine at the Turkish Airport due to this situation.\n\nAt the airport they have said that they cancelled my process of residency permit and that i need to apply again.\n\nSo id really like to know if i can apply at your website for a Multi Touristic Visa. Hope to hear from you soon. Thank you very much.\n\nBest Regards,\nSana Abu Khalil', '88.240.25.11', '2015-02-10 22:20:34', '1', '', ''),
