(210, 'Naif Salamah', 'nsalamah@me.com', 'Wrong nationality', 'Dear i have contacted you for my Visa for me & my family as well our babysiter one of your colleges send me a link which i''ve used & i found after you have issued our Visa that our babysiter the philipines nationality thay but her as Saudi Nationality kindly change it \n\nI''ve send it e-mail to you', '78.95.205.243', '2015-08-16 17:14:23', '1', '', ''),
(211, 'Naif Salamah', 'nsalamah@me.com', 'Wrong nationality', 'Dear Naif Nabil\r\n,<br><br>As per your application reference (QV-55D053C8D2471) you have applied for 5 applicants in total, all holding the same Nationality, so as a result it has been processed.<br><br>If we have to change the nationality for the one Applicant, noted as Philippine national, they should meet the following visa requirements;<br><br>-------------------------------<br><br>For Philippines National, a valid supporting document from any of the OECD member countries; or a\r\n valid residence permit of a Schengen or OECD country as mentioned list \r\nbelow.<br><ul><li>Australia</li><li>Canada</li><li>Chile</li><li>Ireland</li><li>Israel</li><li>Japan</li><li>Korea, Republic of</li><li>Mexico</li><li>New Zealand</li><li>Schengen</li><li>U.S.A</li><li>United Kingdom</li></ul>-------------------------------<br><br>Please make a separate application for that particular Applicant with Philippine nationality by following the this link <a rel="" target="" href="https://quickevisa.com/application">https://quickevisa.com/application</a><br><br>You donâ€™t have to make payment again, we will kindly ask our account department to look into the application.<br><br>Should you require any further help please do not hesitate to contact our team.<br><br>', '', '2015-08-16 19:07:50', '', '1', ''),
