(218, 'Robert  Marien', 'marienrg55@aol.com', 'did not get my visa yet ', 'Dear Mr Robert,<br><br>Thank you for contacting us.<br><br>Upon receipt of your application we identified a error at passport details, and we wrote to you the below email on 29th of July&nbsp; asking for correct information and we did not received any reply from you, so we have cancelled your process and refunded your money back. If you want us to process your application, please apply again and make payment, we will be able to process your application using our priority service.<br><br>---------------sent email----------------- <br><span>Dear\r\nRobert Golden,<br>\r\n<br>\r\nCould you please conform your Turkey Travel date again? We are already started\r\nyour Visa process.<br>\r\n<br></span>W<span><span>e received\r\nyour details as follows, please double check and apply again from here <a rel="" target="" href="https://quickevisa.com/application">https://quickevisa.com/application</a><br><br></span>Passport Issue Date - 29.09.1915<br>\r\nPassport Expiry Date - 28.09.2024<br><br>--------------<br><br>Please do contact us for further support.<br><br></span><br>', '', '2015-08-17 18:12:11', '', '1', ''),
