(225, 'Lema AlTamimi', 'altamimi@fahadaltamimi.com', 'Turky visa for UK Passport/National', 'Dear Lema AlTamimi,<br><br>British nationals need a visa to enter Turkey, except for cruise ship passengers with â€˜British Citizenâ€™ passports entering the country for a day trip, remaining in the port of embarkation and returning to the ship the same day.<br><br>You can get an e-Visa online before you travel through <a rel="" target="" href="https://quickevisa.com">https://quickevisa.com</a> website. <br><br>You can apply up to 3 months in advance of your travel date. Turkish visit visas issued on arrival are valid for multiple stays up to a maximum of 90 days in a 180 day period.<br>', '', '2015-08-18 10:26:44', '', '1', ''),
