(247, 'Judith Taft', 'judyharkness@gmail.com', 'incorrect mailing address', 'Dear Judith Taft,<br><br>Thank you for your email.<br><br>You donâ€™t have to cancel your application which is already been submitted. We have also confirm you that we have received your payment already.<br><br>Please re-submit your application with correct information following this link <a rel="" target="" href="https://quickevisa.com/application">https://quickevisa.com/application</a><br><br>Our support team will successfully process your request and send you the e-visa with updated information soon we can.<br><br>Please be noted, we have already processed your visa on the first application, with information provided. However we are happy to process is once again on our cost to make sure all the correct information are added while processing it.<br><br>So please do not worry, kindly resubmit the application with correct information.<br><br>Thanking you for doing business with us<br><br><br>', '', '2015-08-19 18:51:07', '', '1', ''),
