(260, 'Tamara Stichbury', 'rob.stichbury@shaw.ca', 'Visa to Turkey', 'I am trying to make payment for Me and my husband visa application to Turkey.  I have tried with my master card and Visa and the site will not take it.  Why!!!  If I can not pay with my credit cards then I will have to cancel this.  I do not want to give my bank acct info.  Please explain why I can not pay by my cards.\n\nTamara', '96.51.15.77', '2015-08-20 18:37:30', '1', '', ''),
