(265, 'William Hustrulid', 'whustrulid@aol.com', 'Turkey visa', 'Dear William Hustrulid,<br><br>Thank you for the email.<br><br>There is no record of your full name or the email id whustrulid@aol.com, in our system. <br><br>I would appreciate if you could provide us with our reference number which sent to your email if you applied using quickevisa.com. You can also give your email id and passport number you might have used while applying using quickevisa.com<br><br>Hoping to hear from you soon to trace your application and&nbsp; give you prompt reply.<br><br>Thanking yo once again for contacting us.<br><br><br><br><br><br><br>', '', '2015-08-20 22:05:16', '', '1', ''),
(266, 'prachi khadkikar', 'prachi.pra07chi02@gmail.com', 'turkey visa', 'Dear prachi khadkikar,<br><br>Thank you for your email.<br><br>Your USA visa can be validated for visa application to turkey based on your nationality. Please let us know your nationality and what exactly is our USA visa type, we might be able to check and let you know.<br><br><br>', '', '2015-08-20 22:07:21', '', '1', ''),
