(316, 'mano SANAN', 'mano@appsysinternational.com', 'TURKEY VISA', 'Dear mano SANAN ,<br><br>3 Easy Steps to Apply for your Turkish e-Visa no formalities. <br><br>Apply for your individual, Family or Group e-Visa by utilising our secure online service.<br><br>Turkey e-Visa provides you with an online application service. Complete e-form, pay online and get your instant confirmation via email.<br><br>Fill e-Visa Application Fromm here to get Turkey Visa <a rel="" target="" href="https://quickevisa.com/application">&nbsp; https://quickevisa.com/application</a><br><br><br>', '', '2015-08-25 09:17:01', '', '1', ''),
(317, 'Temitope Folarin', 'toprano@yahoo.com', 'Can I come to turkey with e visa and fly emirate airline ', 'Pls I want to confirm if I can travel to turkey with e visa and fly emirate airline I have US visa', '41.190.14.14', '2015-08-25 10:38:21', '1', '', ''),
(318, 'Temitope Folarin', 'toprano@yahoo.com', 'Can I come to turkey with e visa and fly emirate airline ', 'Dear Temitope Folarin ,<br><br>May i know what is your nationality and which&nbsp; country you are living right now? Then we can assist you&nbsp; to speed up the Turkey Visa process.<br><br>', '', '2015-08-25 12:01:02', '', '1', ''),
(319, 'Peter  DONNELLEY', 'peter.donnelley@bigpond.com', 'APPLICATION TURKEY VISA', 'I APPLIED FOR A TURKISH VISA on approx 2nd August 2015 I have had NO REPLY BUT my visa account has been charged7/08/2015 $A167.16   (girport istanbul )  Please issue me my visa or refund my money  MY DETAILS ARE 1 Passport  m9580321 expire date 11th mar 2019 issued Sydney AUSTRALIA date of birth 13 01 1943\nYOUR EARLIEST CONFIRMATION IS Required', '60.225.40.30', '2015-08-25 11:36:52', '1', '', ''),
(320, 'Peter  DONNELLEY', 'peter.donnelley@bigpond.com', 'APPLICATION TURKEY VISA', 'Dear Peter DONNELLEY,<br><br>Can you provide our reference number ( start with QV-XXXXXXXXXXX),so that we can trace your record in our database.<br><br>Please check your old email for Visa reference ID, if possible please copy email content and send us to understand better.<br><br><br>', '', '2015-08-25 12:56:16', '', '1', ''),
