(347, 'Heba Khoshaim', 'hkhoshaim@gmail.com', 'cannot pay the visa fee', 'I am trying to pay the visa fee but I do not have Paypal account. I received an email on how to pay using only the credit card. However, the page mentioned in the email through a given link does not show to me.  I only have two options: pay using my Paypal account or Create an account.\nPlease advise. ', '37.105.129.160', '2015-08-29 16:07:09', '1', '', ''),
