(349, 'Subrahmanyam', 'bhimas@gmail.com', 'Turkey Visa - You can pay without PayPal account', 'Dear Subrahmanyam Bhima, <br><br>You have applied e-Visa for:<br>Subrahmanyam Bhima<br><br>Thank you for making application to process your Turkey eVisa.<br><br>We have received your information to process your eVisa, we require payment to process further.<br><br>Your application reference number: QV-55E1E61806195 <br><br>Please find link below to make payment to process your Turkey Visa without PayPal account, if you have already paid please ignore this mail.<br><br>Payment Link: <a rel="" target="" href="https://quickevisa.com/index.php/application/payments/QV-55E1E61806195">https://quickevisa.com/index.php/application/payments/QV-55E1E61806195</a><br><br>Some useful information using PayPal below:<br><br>You can pay without PayPal account, to know more click the link - <a rel="" target="" href="http://panelsyndicate.com/help/paypal">http://panelsyndicate.com/help/paypal</a><br><br>In case of your credit card denied, please check this link might be helpful to complete the transaction:<br><br><a rel="" target="" href="https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA">https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA</a><br><br>For assistance, please click here - <a rel="" target="" href="https://quickevisa.com/index.php/contact-us">https://quickevisa.com/index.php/contact-us</a><br><br><br>', '', '2015-08-29 18:14:03', '', '1', '916'),
(350, 'Abdul Razzak Modasia', 'abdulrazzak@zamilsteel.com', 'Tourist Visa', 'Could you please let me know the visa formalities for Tourist. I am an Indian national. will I get the visa on arrival or I have to get the visa first and then only I can travel??', '176.241.191.226', '2015-08-30 07:40:12', '1', '', ''),
(351, 'Bjørg kristine Christoffersen', 'bch@fibernett.net', 'Visum', 'Hi!\nI bokked a visa to Turkey. This went very well and i paid without looking at what it cost.\nDiscovered afterwards that it was drawn 15000/USD. It can not possibly be correct.\n\nTherefore i choose to cancel the whole.\n\nMVH.\nBjørg Christoffersen', '141.101.80.110', '2015-08-30 08:52:39', '1', '', ''),
(352, 'Bjørg kristine Christoffersen', 'bch@fibernett.net', 'Visum', '<div>Dear Bjrg kristine Christoffersen,</div><div><br></div><div>Thank you for contacting quickevisa.com support team.</div><div><br></div><div>Quickevisa.com searched our data base using your email id which you have kindly used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1. Quickevisa.com reference number: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our reference number normally start with (QV) in the front.</div><div><br></div><div>2. In addition to that reference number you can also provide us with your passport number you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the email id used whilst applying for the service.</div><div><br></div><div>4. Payment confirmation which has been confirmed by Quickevisa.com</div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.<br><br><br></div><div><br></div>', '', '2015-08-30 10:15:05', '', '1', ''),
(353, 'IBRAHEM ABDULAZIZ', 'haifa000@hotmail.com', 'Turkey Visa - You can pay without PayPal account', '<div>Dear IBRAHEM ABDULAZIZ ALSHAALAN,</div><div><br></div><div>You have applied e-Visa for:</div><div><br></div><div>&nbsp;IBRAHEM ABDULAZIZ ALSHAALAN &nbsp; L470989</div><div><br></div><div>Thank you for making application to process your Turkey eVisa.</div><div><br></div><div>We have received your information to process your eVisa, we require payment to process further.</div><div><br></div><div>Your application reference number:QV-55E2CE53D3761</div><div><br></div><div>Please find link below to make payment to process your Turkey Visa without PayPal account, if you have already paid please ignore this mail.</div><div><br></div><div>Payment Link : <a href="https://quickevisa.com/index.php/application/payments/QV-55E2CE53D3761" target="" rel="">https://quickevisa.com/index.php/application/payments/QV-55E2CE53D3761</a></div><div><br></div><div>Some useful information using PayPal below:</div><div><br></div><div>You can pay without PayPal account, to know more click the link - <a href="http://panelsyndicate.com/help/paypal" target="" rel="">http://panelsyndicate.com/help/paypal</a></div><div><br></div><div>In case of your credit card denied, please check this link might be helpful to complete the transaction:</div><div><br></div><div><a href="https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA" target="" rel="">https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA</a></div><div><br></div><div>For assistance, please click here - <a href="https://quickevisa.com/index.php/contact-us" target="" rel="">https://quickevisa.com/index.php/contact-us</a></div><div><br></div>', '', '2015-08-30 10:40:48', '', '1', '922'),
(354, 'Hichame Bouzayene', 'h.bouzayene@kabholding.com', 'Wrong Middle Name ', 'We Made electronic visa but the middle name was wrong \nHow we can fix that mistake \n\nReference No : 6S6-6T7V\nName : AMRO AHMED BAGEDO \nTHE CORRECTE NAME : AMRO KHALID BAGEDO ', '37.216.19.207', '2015-08-30 11:09:01', '1', '', ''),
(355, 'Hichame Bouzayene', 'h.bouzayene@kabholding.com', 'Wrong Middle Name ', 'Dear Hichame Bouzayane, <br><br>Thank you for the email.<br><br>I hope that this email finds you having a nice day.<br><br>Your application reference number: QV-55DAC29713048<br><br>You have applied e-Visa for:<br><br>KHALID AHMED B, Passport Number: L680720, Arrival Date: 27.08.2015<br>AMRO AHMED BAGEDO, Passport Number: K653588, Arrival Date: 27.08.2015<br><br>Your visa has been issued based on the information provided by you.<br><br>We understand now that there was an error committed by you while making application at quickevisa.com. Itâ€™s also been noted that your visa arrival date is 27.08.2015.<br><br>Once the visa issues, we cannot do the amendments. So itâ€™s important that correct information provided at the time of making application at quickevisa.com<br><br>We can fix it:<br><br>The only way to rectify the name to CORRECTE NAME : AMRO KHALID BAGEDO, you have to make fresh application for AMRO KHALID BAGEDO by following the link <a rel="" target="" href="http://quickevisa.com/application">http://quickevisa.com/application</a>.<br><br>While making application you have to make new arrival date. This depends if you have already arrived to Turkey, itâ€™s better to take advice from the officials.<br><br>Normally as per our terms and conditions, any fresh application made, payment required to be paid to process the application. <br><br>However we are happy to give special support for you, so you donâ€™t have to pay for it again, and we will process it free of charge and send you a new visa.&nbsp; So while making fresh application for AMRO KHALID BAGEDO, please click to pay and after than you can leave it there without making payment.<br><br>Once applied please contact us via email, we will action it for you.<br><br>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.<br><br>Your copy of eVisa will be held within a secured system at Quickevisa.com in case you have lost your copy, please feel free to contact us via info@quickevisa.com quoting your reference number, we should be able to retrieve a copy and send out to you within 24 hours.<br><br>We wish you a safe onward journey, enjoy your visit to Turkey.<br><br><br><br>', '', '2015-08-30 13:05:26', '', '1', ''),
(356, 'mohemmed saeed', 'bashmeila@hotmail.com', 'Turkey Visa - You can pay without PayPal account', '<div>Dear Mohemmed Saeed Mady,</div><div><br></div><div>You have applied e-Visa for:</div><div>Mohemmed Saeed Mady &nbsp; &nbsp; l374764</div><div><br></div><div><br></div><div>Thank you for making application to process your Turkey eVisa.</div><div><br></div><div>We have received your information to process your eVisa, we require payment to process further.</div><div><br></div><div>Your application reference number: QV-55E2ECF86A2ED</div><div><br></div><div>Please find link below to make payment to process your Turkey Visa without PayPal account, if you have already paid please ignore this mail.</div><div><br></div><div>Payment Link : <a href="https://quickevisa.com/index.php/application/payments/QV-55E2ECF86A2ED" target="" rel="">https://quickevisa.com/index.php/application/payments/QV-55E2ECF86A2ED</a></div><div><br></div><div>Some useful information using PayPal below:</div><div><br></div><div>You can pay without PayPal account, to know more click the link - <a href="http://panelsyndicate.com/help/paypal" target="" rel="">http://panelsyndicate.com/help/paypal</a></div><div><br></div><div>In case of your credit card denied, please check this link might be helpful to complete the transaction:</div><div><br></div><div><a href="https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA" target="" rel="">https://www.paypal.com/us/webapps/helpcenter/helphub/article/?solutionId=FAQ1281&amp;topicID=&amp;m=ARA</a></div><div><br></div><div>For assistance, please click here - <a href="https://quickevisa.com/index.php/contact-us" target="" rel="">https://quickevisa.com/index.php/contact-us</a></div><div><br></div>', '', '2015-08-30 13:14:14', '', '1', '923'),
(357, 'ahmed abdulla', 'ahmed.ali.abdulla@gmail.com', 'turkey visa', 'dear sir madam \nI just made 3 visas for turkey under this order number 6a2fffe9a8 and I just realized that a visa cost $80 and you have charged me $149 I''m not sure why ill be thankful if their is an explanation. and the second issue is that my order is still on waiting.', '162.158.98.91', '2015-08-30 13:02:14', '1', '', ''),
