(376, 'Hichame Bouzayene', 'h.bouzayene@kabholding.com', 'Wrong Middle Name AND ARRIVAL DATE ', 'Dear Hicharne Bouzayene,<br><br>Thank you for contacting us again.<br>Old Application Reference: QV-55DAC29713048<br>New Application Reference: QV-55E45940CE966 <br><br>We have received new application with reference number QV-55E45940CE966 for<br>KHALID AHMED B BAGEDO, Passport Number: L680720<br>AMRO KHALID A&nbsp; BAGEDO, Passport Number K653588 ( Now this name is correctly mentioned)<br><br>It is also noted that you have applied with new Arrival date for both 20.09.2015<br><br>Please be noted that previously issued visa for Mr KHALID AHMED B BAGEDO, Passport Number: L680720 is&nbsp; valid,&nbsp; itâ€™s not compulsory that he must travel on the arrival date mentioned on his visa which is 27.08.2015.&nbsp; Mr KHALID AHMED B BAGEDO, can use his existing eVisa to travel within his validity period which is 22 February 2016.<br><br><br>As we have mentioned in the previous email, we are happy to issue new eVisa for AMRO KHALID A&nbsp; BAGEDO, Passport Number K653588. He will have is validity starting from 20 September 2015.<br><br>Kindly confirm this email, we will go ahead and issue new eVisa for Mr AMRO KHALID A&nbsp; BAGEDO, Passport Number K653588.&nbsp; We will do this process free of charge as we have offered in our previous email.<br>', '', '2015-08-31 15:49:02', '', '1', ''),
