(418, 'Teryl Kidwell', 'terylkidwell@hotmail.com', 'Turkey Visa', 'Dear Teryl Ann,<br><br>It was nice speaking with you over the phone.<br><br>I hope that this email finds you having a nice day.<br><br>Your application reference number: <br>QV-55E72425D8723<br><br>Please be advised that Quickevisa.com received your refund request, as per the telephonic conversation we have already submitted the refund for this application (QV-55E72425D8723)<br><br>For the additional application (QV-55E7207676955) which you have made, please be advised that it has successfully been processed and the e-Visa is available to downlod from the below link.<br><br>Download Link : <a rel="" target="" href="https://quickevisa.com/application/download-evisa/QV-55E7207676955">https://quickevisa.com/application/download-evisa/QV-55E7207676955</a> <br><br>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.<br><br>Your copy of eVisa will be held within a secured system at Quickevisa.com in case you have lost your copy, please feel free to contact us via info@quickevisa.com quoting your reference number, we should be able to retrieve a copy and send it across to you within 24 hours.<br><br>We wish you a safe onward journey, enjoy your visit to Turkey.<br>', '', '2015-09-02 18:24:46', '', '1', ''),
