(422, 'Haluk Sarac', 'saracz@bigpond.com.au', 'Turkish Visa', 'Good morning\nOn 29 August 2015, I applied for Turkish Visa. I have paid my $99US and received an application Reference number APP28AUG2015526. I did not received the visa. A few days later I went to on line and checked the status of my application and I received a message saying I quote" your payment and application have been received. The application being processed and your visa will be sent to you shortly". I still do not have a visa or have not received and information about my application, whether it is not successful etc. I went to the web site today and now the web site can not recognise my application number. I would appreciate it if you could kindly inform me the status of my application for Turkish Visa.\nYours sincerely\nH. Zafer Sarac', '58.165.115.238', '2015-09-02 23:50:31', '1', '', ''),
(423, 'Haluk Sarac', 'saracz@bigpond.com.au', 'Turkish Visa', 'Dear Haluk Sarac,<br><br>Thank you for contacting quickevisa.com support team.<br><br>Quickevisa.com searched our data base using your email id which you have kindly used to send this email. Unfortunately we are unable to locate your information.<br><br>For us to reply back to this query, please provide us the following information;<br><br>1. Quickevisa.com reference number: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our reference number normally start with (QV) in the front.<br><br>2. In addition to that reference number you can also provide us with your passport number you might have used whilst applying.<br><br>3. Or you can provide us with the email id used whilst applying for the service.<br><br>4. Payment confirmation which has been confirmed by Quickevisa.com<br><br>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.<br><br>Please note normally all queries are answered within 24 hours.<br><br>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.<br><br><br>', '', '2015-09-03 01:14:58', '', '1', ''),
