(447, 'Trevor John', 'trevor.chalk@bigpond.com', 'Refund/ Passport should have minimum 6 months validity', 'Dear Trevor John Chalk,<br><br>I hope that this email finds you having a nice day.<br><br>Your application reference number: QV-55EAA4C18D5C4 <br><br>Please be advised that Quickevisa.com unable to process your application, from your application we noticed that your passport expiry date is 01.02.2016. To apply for eVisa your need to have passport with minimum of 6 month expiry period, kindly re-apply with your renewed passport in order to process your application.<br><br>We have already allocated you the refund back to you.<br><br>Thank you for untilising of eVisa application service.<br><br>As soon as you obtain the new passport you can make application by following this link <a rel="" target="" href="http://quickevisa.com/application">http://quickevisa.com/application</a><br><br><br>', '', '2015-09-05 09:56:01', '', '1', '1033'),
