(452, 'Kylie McCormack', 'missymac3006@hitmail.com', 'APP27AUG2015522', 'I have not received my Turkish e-visa. Only received an email saying my application has bee successfully submitted. Your help in this matter is greatly appreciated. ', '1.129.96.232', '2015-09-06 00:25:45', '1', '', ''),
(453, 'Kylie McCormack', 'missymac3006@hitmail.com', 'APP27AUG2015522', 'Dear Kylie McCormack,<br><br>Thank you for contacting quickevisa.com support team.<br><br>Quickevisa.com searched our data base using your email id which you have kindly used to send this email. Unfortunately we are unable to locate your information.<br><br>For us to reply back to this query, please provide us the following information;<br><br>1. Quickevisa.com reference number: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our reference number normally start with (QV) in the front.<br><br>2. In addition to that reference number you can also provide us with your passport number you might have used whilst applying.<br><br>3. Or you can provide us with the email id used whilst applying for the service.<br><br>4. Payment confirmation which has been confirmed by Quickevisa.com<br><br>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.<br><br>Please note normally all queries are answered within 24 hours.<br><br>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.<br><br><br>', '', '2015-09-06 01:39:35', '', '1', ''),
