(466, 'Soo Young Lee', 'syy@histogenetics.com', 'Turkey Visa', 'Dear Soo Young,<br><br>I hope that this email finds you having a nice day.<br><br>Your application reference number:QV-55E9BCC777BF7<br><br>You have applied e-Visa for:<br>Soo Young Lee, Passport Number: 501049852<br><br>Your eVisa has already been sent to your email.<br><br>Just in case you did not receive any email, you are kindly requested to check your spam folder.<br><br>However to save time, please follow the below secured and encrypted link to download your e-Visa directly.<br><br>Download Link : <a rel="" target="" href="https://quickevisa.com/application/download-evisa/QV-55E9BCC777BF7">https://quickevisa.com/application/download-evisa/QV-55E9BCC777BF7</a> <br><br>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.<br><br>Your copy of eVisa will be held within a secured system at Quickevisa in case you have lost your copy, please feel free to contact us via info@quickevisa.com quoting your reference number, we should be able to retrieve a copy and send out to you within 24 hours.<br><br>We wish you a safe onward journey, enjoy your visit to Turkey.<br><br><br>', '', '2015-09-07 16:29:49', '', '1', ''),
