(469, 'FAISAL MOHAMMED', 'aziz.14.11.10@gmail.com', 'Turkey Visa - Use debit card instead of Credit Card in PayPal', 'Dear FAISAL MOHAMMED,<br><br>Congratulation for successful Turkey Visa registration, reference number: <b>QV-55EDDA0038680</b><br><br>We\r\n have received your information to process your Turkey eVisa, we require\r\n payment to process further,<b> if you have already paid please ignore this\r\n mail.</b><br><br><b>Please note: </b>If you find difficulty in making payment using Credit card it is advisable to use debit card instead.<br><br><b>Make a payment Now, Payment Link : <a rel="" target="" href="https://quickevisa.com/index.php/application/payments/QV-55EDDA0038680">https://quickevisa.com/index.php/application/payments/QV-55EDDA0038680</a></b><br><br>In case of your credit / Debit card denied, it might be helpful to complete the transaction: <a rel="" target="" href="https://goo.gl/zwVc0z">https://goo.gl/zwVc0z</a><br><br>For assistance, please click here -<a rel="" target="" href="https://quickevisa.com/index.php/contact-us">https://quickevisa.com/index.php/contact-us</a><br><br><br><br><br><br><br>', '', '2015-09-07 20:00:22', '', '1', '1076'),
