(567, 'Mina', 'minam@mbmbinc.com', 'Turkey Visa - Need valid supporting document ', 'Dear Mina,<br><br>Your Turkey Visa application reference number: <b>QV-55F4575F7DD46</b><br><br>Unfortunately Turkey Embassy changed new rules for for <b>Liberia Nationality, </b>must<b> </b>a valid supporting document like <b>"Visa or residence"</b> or from any of the OECD member countries.<br><br>Permit of a Schengen or OECD country as mentioned list below.<br><br><b><u>Visa Supporting document:</u></b><br><br>&nbsp;&nbsp;&nbsp; Australia<br>&nbsp;&nbsp;&nbsp; Canada<br>&nbsp;&nbsp;&nbsp; Chile<br>&nbsp;&nbsp;&nbsp; Ireland<br>&nbsp;&nbsp;&nbsp; Israel<br>&nbsp;&nbsp;&nbsp; Japan<br>&nbsp;&nbsp;&nbsp; Korea, Republic of<br>&nbsp;&nbsp;&nbsp; Mexico<br>&nbsp;&nbsp;&nbsp; New Zealand<br>&nbsp;&nbsp;&nbsp; Schengen<br>&nbsp;&nbsp;&nbsp; U.S.A<br>&nbsp;&nbsp;&nbsp; United Kingdom<br><br><b><u>Residency Supporting document:</u></b><br><br>Belgium<br>Canada<br>Chile<br>Czech Republic<br>Denmark<br>Estonia<br>Finland<br>France<br>Germany<br>Greece<br>Hungary<br>Iceland<br>Ireland<br>Israel<br>Italy<br>Japan<br>Korea, Republic of<br>Latvia<br>Liechtenstein<br>Lithuania<br>Luxembourg<br>Malta<br>Mexico<br>Netherlands<br>New Zealand<br>Norway<br>Poland<br>Portugal<br>Schengen<br>Slovakia<br>Slovenia<br>Spain<br>Sweden<br>Switzerland<br>U.S.A<br>United Kingdom<br><br>IF you have any one of the document mentioned above with you we will process your Turkey Visa or we will back&nbsp; your money. <br><br>For assistance, please click here -<a rel="" target="" href="https://quickevisa.com/index.php/contact-us">https://quickevisa.com/index.php/contact-us</a><br><br><br>', '', '2015-09-12 18:43:26', '', '1', '1227'),
(568, 'joanne wilson', 'walkieswithjo@hotmail.co.uk', 'visa', 'we bought a e visa in july and we are returning to turkey on 8th october till 13th october 2015, am i covered from my old visa? entered last time on 19/07/2015, please advise as we have had missed messages from different sources, many thanks', '82.25.200.102', '2015-09-12 17:55:47', '1', '', ''),
(569, 'Mina', 'minam@mbmbinc.com', 'Additional Information ', '<div>Dear Mina,</div><div><br></div><div>Your Turkey e-Visa application reference number: QV-55F4575F7DD46</div><div><br></div><div>Unfortunately the&nbsp;Turkey Embassy has&nbsp;changed its rules for Liberia Nationality, a valid supporting document such as a&nbsp;"Visa" or "residence" from any of the OECD member countries listed below.</div><div><br></div><div>Permit of a Schengen or OECD country as mentioned in the&nbsp;list below.</div><div><br></div><div>Visa Supporting document:</div><div><br></div><div>&nbsp; &nbsp; Australia</div><div>&nbsp; &nbsp; Canada</div><div>&nbsp; &nbsp; Chile</div><div>&nbsp; &nbsp; Ireland</div><div>&nbsp; &nbsp; Israel</div><div>&nbsp; &nbsp; Japan</div><div>&nbsp; &nbsp; Korea, Republic of</div><div>&nbsp; &nbsp; Mexico</div><div>&nbsp; &nbsp; New Zealand</div><div>&nbsp; &nbsp; Schengen</div><div>&nbsp; &nbsp; U.S.A</div><div>&nbsp; &nbsp; United Kingdom</div><div><br></div><div>Residency Supporting document:</div><div><br></div><div>Belgium</div><div>Canada</div><div>Chile</div><div>Czech Republic</div><div>Denmark</div><div>Estonia</div><div>Finland</div><div>France</div><div>Germany</div><div>Greece</div><div>Hungary</div><div>Iceland</div><div>Ireland</div><div>Israel</div><div>Italy</div><div>Japan</div><div>Korea, Republic of</div><div>Latvia</div><div>Liechtenstein</div><div>Lithuania</div><div>Luxembourg</div><div>Malta</div><div>Mexico</div><div>Netherlands</div><div>New Zealand</div><div>Norway</div><div>Poland</div><div>Portugal</div><div>Schengen</div><div>Slovakia</div><div>Slovenia</div><div>Spain</div><div>Sweden</div><div>Switzerland</div><div>U.S.A</div><div>United Kingdom<br><br>There must be a period of six months validity on the supporting documents allocated.</div><div><br></div><div>Its necessary to&nbsp;have a round-trip ticket with Turkish Airlines, Pegasus Airlines or Onur Air.<br><br>Please provide Quickevisa.com an update via info@quickevisa.com in order for your application to be further processed.<br><br><b>In summary to recap&nbsp;you must meet the following conditions:</b><br><br><div>You must meet all the requirements listed below in order to obtain an e-Visa. If you do not meet any of these requirements and you proceed with your application, your e-Visa will be invalid.</div><div><br></div><div>I have a round-trip ticket with Turkish Airlines, Pegasus Airlines or Onur Air.</div><div><br></div><div>I am travelling for the purposes of tourism or business.</div><div><br></div><div>I hold a valid supporting document (Schengen visa or a valid visa from any of the OECD member countries; or a valid residence permit of a Schengen or OECD country). e-Visas are not accepted as a supporting document.</div><div><br></div><div>I can prove that I hold a return ticket, hotel reservation and at least 50 $ per each day of my stay.</div><div><br></div><div>I hold a passport valid for at least 6 months from the date I intend to enter Turkey.</div><div><br></div><div>I confirm that I meet each and every one of the conditions listed above.</div></div><div><br></div>', '', '2015-09-12 19:10:19', '', '1', '1227'),
(570, 'Mathias Klomstad', 'm-klomstad@hotmail.com', 'Norsk', 'Søker on pass for innreise til Tyrkia den 13. november, 2015,  til 27. november 2015  \nFormålet med oppholdet i tyrkia er deltakelse i feriereise, sammen med min hustru,  Astri Marie Klomstad, 280433 37604\nArrangør er BONDEBLADET.\nMvh.Mathias Klomstad,  140134 33969', '141.101.81.87', '2015-09-12 20:44:26', '1', '', ''),
