(576, 'Usha', 'usha.rajaram@gmail.com', '', 'Dear Usha Rajaram,<br><br>I hope that this email finds you having a nice day.<br><br>Your application reference number: QV-55F42E3417389 <br><br>You have applied e-Visa for:<br>Customer Name and Passport Number (more customer list below in order)<br><br>Please be advised that Quickevisa.com is pending update from you in line with your visa issuing country. We have been trying to be in touch with you to get further information, but have not obtained the necessary information to date.<br><br>As per our policy your refund has been allocate automatically, please check your Paypal refund transaction.<br><br>Thank you for utilising quickevisa.com eVisa application service.<br><br>As soon as you obtain the the required information,&nbsp; you can make fresh application by following this link <a rel="" target="" href="http://quickevisa.com/application">http://quickevisa.com/application</a><br><br><br>', '', '2015-09-13 10:59:39', '', '1', '1225'),
(577, 'NASSER JIKIRI', 'alnassir_jikiri@yahoo.com', 'VISA INQUIRY', 'Good Day,\n\ni would like to spend my Eid holiday in Istanbul Turkey from 23-26 of september, when i tried to apply visa online, ive notice on the list of requirement that " Must hold a valid Schengen visa or a valid visa from any of the OECD (USA, Canada etc.) member countries.Or I have a valid residence permit of a Schengen or OECD country."  im a filipino citizen and currently working in Dubai, UAE for 6 years now. the problem is i don''t have schengen visa yet. am i still qualified to apply online visa?\n\nplease inform me at the earliest.\n\nkind regards \nNasser\n', '2.50.54.46', '2015-09-13 10:10:11', '1', '', ''),
