(589, 'Akif Birgi', 'violylabarro@yahoo.com', 'Visa to philippines', 'To whom It may concern,\n                    I am a Turkish nationality That living and working in London for 14 years\nI am planning to visit the beautiful country of the Philippines, what do i need to do to get the visa? Do I am allowed to visit the country, How much it will cost me, How many days i can stay, and what Documents Do i need to prepare?\n\n\nThank you very much and power\n\nVery respectfully yours,\nAkif', '173.245.62.132', '2015-09-13 16:56:32', '1', '', ''),
