(606, 'Wesley Harlow', 'Wsharlow@gmail.com', 'Is it possible to change dates on my e-visa', 'To whom it may concern,\n\nI applied for and purchases two e-visas for myself and my fiance. Originally we would be in Istanbul for one day September 21, however we have changed to an earlier flight that would land in Istanbul on September 19th. Is it possible to change to dates on these e-visa and reissue them? The information for them is Reference Number HGV-PYHD, and 89G-Y2PL. Thank you for your time and concern with this matter. I look forward to hearing from you. Sincerely,\nWesley Harlow\nwsharlow@gmail.com', '148.168.96.21', '2015-09-14 12:04:14', '1', '', ''),
(607, 'Wesley Harlow', 'Wsharlow@gmail.com', 'Is it possible to change dates on my e-visa', 'Dear Wesley Harlow,<br><br>Thank you for contacting quickevisa.com support team.<br><br>Quickevisa.com searched our data base using your email id which you have kindly used to send this email. Unfortunately we are unable to locate your information.<br><br>For us to reply back to this query, please provide us the following information;<br><br>1. Quickevisa.com reference number: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our reference number normally start with (QV) in the front.<br><br>2. In addition to that reference number you can also provide us with your passport number you might have used whilst applying.<br><br>3. Or you can provide us with the email id used whilst applying for the service.<br><br>4. Payment confirmation which has been confirmed by Quickevisa.com<br><br>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.<br><br>Please note normally all queries are answered within 24 hours.<br><br>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.<br><br>Please Note: For your information, after reading your, The visa issued on 21 September means, you can arrive in turkey on or after 21 September. Changing that to 19 September means you may have to apply for new eVisa, the changes to the issued visa not possible.<br><br>Alternatively: If you are a citizen of one of the countries listed below and you meet the required criteria, you can obtain a visa on<b> arrival. </b><br><br>Antigua and Barbuda<br>Armenia<br>Australia<br>Austria<br>Bahamas<br>Bahrain<br>Barbados<br>Belgium<br>Bhutan<br>Canada<br>Croatia<br>Dominica<br>Dominican Republic<br>Estonia<br>Greek Cypriot Administration of Southern Cyprus<br>Grenada<br>Haiti<br>Hong Kong (BN(O))<br>Indonesia<br>Iraq<br>Ireland<br>Jamaica<br>Kuwait<br>Latvia<br>Lithuania<br>Maldives<br>Malta<br>Mauritius<br>Mexico<br>Netherlands<br>Norway<br>Oman<br>Poland<br>Portugal<br>Qatar<br>Saint Lucia<br>Saint Vincent and the Grenadines<br>Saudi Arabia<br>Solomon Islands<br>Spain<br>U.S.A<br>United Arab Emirates<br>United Kingdom<br>Vanuatu<br>Yemen<br><br><br><br><br>', '', '2015-09-14 13:14:02', '', '1', ''),
