(745, 'comfort  clement', 'commyclem@yahoo.com', 'applying for turkey visa', 'Dear comfort clement,<br><br>Thank you for contacting Turkey Quick eVisa<br><br>3 Easy Steps to Apply for your Turkey e-Visa no formalities.<br><br>Apply for your individual, Family or Group e-Visa by utilising our secure online service.<br><br>Fill e-Visa Application Fromm here to get Turkey Visa&nbsp;&nbsp; <a rel="" target="" href="https://quickevisa.com/application">https://quickevisa.com/application</a><br><br>', '', '2015-09-20 13:50:46', '', '1', ''),
(746, 'MOHAMMED TARSAN', 'thesway@hotmail.com', 'CANEL MY VISA', '<div>Dear MOHAMMED TARSAN,</div><div><br></div><div>Thank you for contacting quickevisa.com support team.</div><div><br></div><div>Quickevisa.com\r\n searched our data base using your email id which you have used to send \r\nthis email / phone number. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1.\r\n Quickevisa.com reference number: whilst applying for using \r\nquickevisa.com e-visa application support -digital service portal, you \r\nwould have received an automated confirmation email with a reference \r\nnumber. Our 15 digits reference number normally<b> start with \r\n(QV-XXXXXXXXXXXXX) in the front.</b></div><div><br></div><div>2. In addition to that reference number you can also provide us with your passport number you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the email id used whilst applying for the service.</div><div><br></div><div>4. Payment confirmation which has been confirmed by Quickevisa.com</div><div><br></div><div>We\r\n would require any of the above four sources of information for us to be\r\n able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank\r\n you for contacting us, please let us know the choice of data to be \r\nprovided, as soon as possible in order for us to serve you better.</div>', '', '2015-09-20 13:54:29', '', '1', ''),
