(756, 'Abdulaziz  ALTHOMALI', 'naif_m1@hotmail.com', 'Turkish visa application ', '<div>Dear<b> </b>Abdulaziz ALTHOMALI,</div><div><br></div><div>Thank you for contacting Quickevisa.com</div><div><br></div><div>We\r\n are sorry that we are unable to help you at this point in time, your \r\nrecord is not held on our system, and we have to conclude that you never\r\n applied via quickevisa.com.</div><div><br></div><div>Please be noted \r\nfrom that email you have just sent to us now, we can note that you have \r\nprocessed your visa from different website and this website does not \r\nbelong to us. I kindly suggest you to contact them directly and ask for \r\nclarification/refund/Cancelation.</div><div><br></div><div>We hope we have done our best to support you at this occasion.</div><div><br></div><div>Thank you for contacting us.</div>', '', '2015-09-21 12:07:34', '', '1', '');
