(777, 'Peter Rong Chao Chen', 'prcchen.ccsa@hotmail.com', 'turkish visa', 'Dear Peter Rong Chao Chen,<br><br>Thank you for contacting Turkey Quick eVisa<br><br>3 Easy Steps to Apply for your Turkey e-Visa no formalities.<br><br>Apply for your individual, Family or Group e-Visa by utilising our secure online service.<br><br>Fill e-Visa Application Fromm here to get Turkey Visa&nbsp;&nbsp; <a rel="" target="" href="https://quickevisa.com/application">https://quickevisa.com/application</a><br>', '', '2015-09-22 02:51:44', '', '1', ''),
(778, 'geraldne dexter', 'jeridexter@comcast.net', 'Used wrong credit card...should be master card not visa', 'Dear geraldne dexter ,<br><br>Your Turkey Visa reference number - <b>QV-560052C3E31AA</b><br><br>We will consider only names as per the passport does not matter about credit card names. We already sent visa please check your email and you paid twice we will refund very soon.<br><br><b>Download Turkey Visa here: <a rel="" target="" href="https://quickevisa.com/application/download-evisa/QV-560052C3E31AA">https://quickevisa.com/application/download-evisa/QV-560052C3E31AA</a> </b><br><div><br></div><div>We wish you a safe onward journey, enjoy your visit to Turkey.</div><br>', '', '2015-09-22 03:30:51', '', '1', ''),
(779, 'charles eugene', 'stanchaseu@aol.com', 'Turkey Visa - can you confrom passport expiry date?', '<div>Dear<b>&nbsp;charles eugene</b><b>,</b></div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:&nbsp;<b>QV-560058CA8EEEC</b>&nbsp;</div><div><br></div><div>Please be advised that Quickevisa.com is pending update from you in line with passport expiry date not correct i think, please can you check and confirm to us.</div><div><br></div><div><b>Please note:</b> you do not have to make fresh application, your email confirmation of the changes will be added to the application with your full authorization.</div><div><br></div><div>If quickevisa.com do not obtain the necessary information, we will try to contact you again or else the e-visa application order case will be sent to refund department</div>', '', '2015-09-22 03:39:06', '', '1', '1473'),
