(829, 'Munirah adel', 'q8_1990@hotmail.com', 'Edit : Incorrect Information- Passport related error (ET301C)', '<div>Dear<b>&nbsp;Munirah adel</b><b>,</b></div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: <b>QV-560427724F578</b> <br></div><div><br></div><div>Please be advised that <b>Quickevisa.com</b> is pending update from you in line with <b>Your Passport(</b><b>003180106) Expiry Date Should be more than six months from your Arrival Date</b>, please can you check and confirm to us.</div><div><br></div><div>Please send us an email to <a rel="" target="">[email&nbsp;protected]</a>\r\n/*  */ quoting your reference number and full name.</div><div><br></div><div><b>Please note</b>: you do not have to make a fresh application, your email confirmation of the changes will be added to the application with your full authorisation.</div><div><br></div><div>If <b>Quickevisa.com </b>do not obtain the necessary information, we will try to contact you again via telephone.&nbsp; If we fail to obtain the necessary informaiton the e-visa application order case, will be sent to refund department</div><div><br></div><div>Thank you<b>, Quickevisa.com</b> Support Team,</div><br><br><br>', '', '2015-09-24 18:46:04', '', '1', '1523'),
(830, 'Katherine Jones', 'jones.kthrn@gmail.com', 'IMP: Ethical Website Campaign', 'Dear Webmaster,\n\n \n\nMy name is Katherine, I want to share a few things about your website, Quickevisa.com , that I observed while visiting it.\n\n \n\nI found your website listed in the Google sponsored listings, which cost you money for each click. However, sometimes these sponsored listings, also known as PPC (pay per click) ads, can create bidding wars. You pay each time somebody clicks on your ad. That can hurt your wallet! Why not try SEO techniques to optimize your website and increase traffic?\n\n \n\nWith Pay-per-click ads PPC, you may increase traffic visits to your site and sell products but it costs you hard earned money for each visitor. Even worse, if you stop paying them the results will vanish suddenly. However, using proper SEO techniques, results won’t diminish even if you stop paying.\n\n \n\nDid you know that 85% of search engine users prefer to click on natural search results rather than sponsored/PPC ads?\n\n \n\nBy investing in effective SEO techniques for a few months you will see a drastic change in your website growth, traffic and ultimately sales! We will show you improvements on your keyword ranking, link popularity and organic traffic within a given time frame.\n\n \n\nAre you aware of your business competitors? Are you satisfied with your current website search results ranking compared to your competitors? Satisfaction is possible utilizing proper SEO optimization. Investing in effective SEO techniques\n\n    Provides lasting benefits.\n    Forces website improvements.\n    Can capitalize on social media.\n    Increases traffic.\n    Better Return on Investment than normal ads.\n    Makes your website stand out against the internet''s 750 million websites.\n\n \n\nDo let me know if you are interested; and I would be happy to share our Methodologies and Prices.\n\n \n\nWe are confident that we can be of use to your company.\n\n \n\nIf you would like to explore more, kindly write me back with any queries you have so we can take this further.\n\nKindest Regards,\n\n \n\nKatherine Jones\n\nInternet Marketer.\n\n \n\nNote: This is an advertisement and a promotional mail in adherence to the guidelines of CAN-SPAM act 2003. We have clearly mentioned the source id of this mail, also clearly mentioned the subject line; and they are in no way misleading in any form. We have found your email address through our own efforts on the web search and not through any illegal way. If you find this email unsolicited, please reply with “REMOVE” in the subject line and we will take care that you don’t receive any further promotional mail.', '103.22.201.106', '2015-09-24 17:46:59', '1', '', ''),
(831, 'Jose', 'jcuervoh@yahoo.com.mx', 'Turkey Visa - Difficulty in making payment?', '<div><b>Dear </b><b>Jose,<br><br>Congratulation for successful Turkey Visa registration</b>, <b>Application Reference Number: </b><b>QV-5604408555C0C</b><b><br><br></b></div><div><b>Please note:</b> If you find difficulty in making payment use <b>"Debit Card" instead "Credit Card"</b>. <b>Please ignore if already paid.</b></div><br><b>Payment Link : <a rel="" target="" href="https://quickevisa.com/index.php/application/payments/QV-5604408555C0C">https://quickevisa.com/index.php/application/payments/QV-5604408555C0C</a></b><br><br><div>In case of your Credit / Debit card denied, it might be helpful to complete the transaction:&nbsp;</div><div><a rel="" target="" href="https://goo.gl/zwVc0z">https://goo.gl/zwVc0z</a></div>', '', '2015-09-24 20:13:06', '', '1', '1525'),
