(835, 'aimerance dibaya', 'metadaime@gmail.com', 'Turkey Visa -  A valid supporting document Required', 'Dear aimerance dibaya,<br><br>Your Turkey e-Visa application reference number: <b>QV-56049679DA839</b><br><br><b>Unfortunately the Turkey Embassy has changed its rules for "Congo Democratic Republic" Nationality</b>, a valid supporting document such as a "Visa" or "residence" from any of the OECD member countries listed below.<br><br><b>Permit of a Schengen or OECD country as mentioned in the list below.</b><br><br><b>Visa Supporting document:</b><br><ul><li>&nbsp;&nbsp;&nbsp; Australia</li><li>&nbsp;&nbsp;&nbsp; Canada</li><li>&nbsp;&nbsp;&nbsp; Chile</li><li>&nbsp;&nbsp;&nbsp; Ireland</li><li>&nbsp;&nbsp;&nbsp; Israel</li><li>&nbsp;&nbsp;&nbsp; Japan</li><li>&nbsp;&nbsp;&nbsp; Korea, Republic of</li><li>&nbsp;&nbsp;&nbsp; Mexico</li><li>&nbsp;&nbsp;&nbsp; New Zealand</li><li>&nbsp;&nbsp;&nbsp; Schengen</li><li>&nbsp;&nbsp;&nbsp; U.S.A</li><li>&nbsp;&nbsp;&nbsp; United Kingdom</li></ul><b>Residency Supporting document:</b><br><br><ul><li>Belgium</li><li>Canada</li><li>Chile</li><li>Czech Republic</li><li>Denmark</li><li>Estonia</li><li>Finland</li><li>France</li><li>Germany</li><li>Greece</li><li>Hungary</li><li>Iceland</li><li>Ireland</li><li>Israel</li><li>Italy</li><li>Japan</li><li>Korea, Republic of</li><li>Latvia</li><li>Liechtenstein</li><li>Lithuania</li><li>Luxembourg</li><li>Malta</li><li>Mexico</li><li>Netherlands</li><li>New Zealand</li><li>Norway</li><li>Poland</li><li>Portugal</li><li>Schengen</li><li>Slovakia</li><li>Slovenia</li><li>Spain</li><li>Sweden</li><li>Switzerland</li><li>U.S.A</li><li>United Kingdom</li></ul>There must be a period of six months validity on the supporting documents allocated.<br><br><b>Its necessary to have a round-trip ticket with Turkish Airlines, Pegasus Airlines or Onur Air.</b><br><br>Please provide Quickevisa.com an update via info@quickevisa.com in order for your application to be further processed.<br>', '', '2015-09-25 07:11:02', '1', '1', '1532'),
