(883, 'Beverley Scutts', 'gizzy.scutts@gmail.com', 'Visa Application', '<div>Dear Beverley Scutts,</div><div><br></div><div>Thank you for contacting <b>Quickevisa.com </b>support team.</div><div><br></div><div><b>Quickevisa.com </b>have searched our data base using your email id which you have used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1. <b>Quickevisa.com</b> reference number: whilst applying for using <b>quickevisa.com</b> e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. The15 digit reference number normally starts with (<b>QV-</b>XXXXXXXXXXXXX) in the front.</div><div><br></div><div>2. In addition to that reference number you can also provide us with your <b>passport number, </b>you would have used whilst applying.</div><div><br></div><div>3. Alternatively you can provide us with the email id used whilst applying for the service.</div><div><br></div><div>4. 0r finally, Payment confirmation which has been confirmed by <b>Quickevisa.com</b></div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within <b>24 hours.</b></div><div><br></div><div>Please let us know the choice of data to be provided as soon as possible in order for us to serve you better.</div><div></div><div></div><br>Thank you for contacting <b>Quickevisa.com</b> Support Team,<br>', '', '2015-09-27 12:12:08', '', '1', ''),
