(895, 'Vaibhav Dhanak', 'golfgold999@gmail.com', 'e-visa no: 877512569380', 'hello! \n\nI applied for e-visa and i have received the visa. This email is regarding the mistake i have done while entering the my personal information on the application form. The nationality I entered is United Arab Emirates instead of India. I got confused between the country of origin and nationality while entering the details. I called the embassy in Dubai, UAE but they said they cannot do anything. So please can Someone help me with the application error.\n\nI also came to know that if i hold a current USA Visa on my passport i can get a visa on arrival at the Turkey Immigration. So do i need to reapply for the visa or the error will be rectified by the embassy.\n\nPlease help me out as soon as possible as the purpose of the visit to Turkey is attending the Jewelry Exhibition which is on the 15th - 18th October 2015. \n\nThank You,\nVaibhav Dhanak', '162.158.98.87', '2015-09-28 05:38:36', '1', '', ''),
(896, 'Vaibhav Dhanak', 'golfgold999@gmail.com', 'e-visa no: 877512569380', '<div>Dear&nbsp;<b>Vaibhav Dhanak,</b><br><div><br></div><div>Thank you for contacting <b>Quickevisa.com<br><br></b></div>Please be advised that which web site you are applied from? We hope we have done our best to support you on this occasion.<br><br>Thank you for contacting <b>Quickevisa.com</b> Support Team,</div><br>----------------------------------------------------------------------------<br>Your actual email<br><br><div>\r\n<b>subject :</b> e-visa no: 877512569380<br><br></div>\r\n<div>\r\n<b>Message :</b> hello!\r\nI applied for e-visa and i have received the visa. This email is \r\nregarding the mistake i have done while entering the my personal \r\ninformation on the application form. The nationality I entered is United\r\n Arab Emirates instead of India. I got confused between the country of \r\norigin and nationality while entering the details. I called the embassy \r\nin Dubai, UAE but they said they cannot do anything. So please can \r\nSomeone help me with the application error.\r\nI also came to know that if i hold a current USA Visa on my passport i \r\ncan get a visa on arrival at the Turkey Immigration. So do i need to \r\nreapply for the visa or the error will be rectified by the embassy.\r\nPlease help me out as soon as possible as the purpose of the visit to \r\nTurkey is attending the Jewelry Exhibition which is on the 15th - 18th \r\nOctober 2015.\r\nThank You,\r\nVaibhav Dhanak<br><br></div>\r\n<div>\r\n<b>Created Date:</b> 2015-09-28 05:38:36 \r\n</div><br><br><br><br>', '', '2015-09-28 07:00:59', '', '1', ''),
(897, 'Vinit  Joshi', 'vinit225@gmail.com', 'Turkey Visa', 'Dear Concerned,\n\nPlease note that I had applied for an e-visa vide Order Number e537b05ef1. \n\nI have paid USD 99.00 for Multiple Entry Visa to Turkey.\n\nMy Passport number is Z3014069 dt 27-04-2015 valid upto 26-04-2025 and also have already a valid Schengen Visit Visa + USA Visit Visa.\n\nI need to travel today.\n\nAs per your website , I should get the visa by today. Kindly advise the status of the same.\n\nThanking you.\nBest Regards,\nVinit \n+971504597729\n\n', '2.50.40.75', '2015-09-28 06:23:58', '1', '', ''),
(898, 'VIVEK MODI', 'vivekm@sixco.ae', 'VISA ENQUIRY', 'I am planning tour (4 days & 3 nights) to Istanbul from Bahrain with my family. Tour period – 16 Dec15 -19 dec15 \nI want to enquire about visa procedures there. All 5 members are indian passport holders. We are 2 couples & one children (aged 6 years). Out of two couples, one has residence permit of Bahrain while another couple have only visit visa of Bahrain. \nPl confirm following:\na) Can we all get visa on arrival at Istanbul airport\nb) Can couple on visit visa to bahrain also get visa on arrival at Istanbul airport.\nc) can couple on visit visa to bahrain fly from Bahrain or they should travel from India directly\n', '89.148.20.164', '2015-09-28 07:53:56', '1', '', ''),
