(905, 'Essam Bukhari', 'ahmadbukhari1991.ab@gmail.com', 'Reference number', 'Hello, \nI have applied for the visa an hour ago, for me and my wife. However, our arrival date is 29th , that means we have about 6 hour before we get to the airport with our visas ready, unfortunately,  I have not received a confirmation e-mail yet, can you please confirm my application status.\n\nMy name : essam bukhari', '162.158.95.22', '2015-09-28 15:32:07', '1', '', ''),
(906, 'Essam Bukhari', 'ahmadbukhari1991.ab@gmail.com', 'Reference number', '<div>Dear<b>&nbsp;</b><b>Essam Bukhari,</b></div><div><br></div><div>Thank you for contacting <b>Quickevisa.com</b></div><div><br></div><div>We are sorry that we are unable to help you at this point in time, your record is not held on our system and we have to conclude that you never applied via <b>Quickevisa.com <br></b></div><div><br></div><div>Please be advised from the email in which you have just sent to us, we can advise you that you have processed your e-visa application from an <b>alternative website provider which is not affiliated to us.</b>&nbsp; I kindly suggest&nbsp; that you contact them directly and ask for clarification/notification.<br><br></div><div>We hope we have done our best to support you on this occasion.</div><div><br></div><div>Thank you for contacting <b>Quickevisa.com</b> Support Team,<br></div><div><br></div>', '', '2015-09-28 16:52:20', '', '1', ''),
(907, 'Essam Bukhari', 'ahmadbukhari1991.ab@gmail.com', 'Issuing the visas', 'Hello, \nI have an application with a reference number : b5ede91775,\n\nOur entery to istanbul will be tomorrow early in the morning, to be more specific, we have to get our visas in the next six hours so we can enter turkey with our visas provided. Can you please confirm if you can issue the visas in the next six hours ? If not what do you advice us to do ? Are we able to issue visas from the airport ? \n\nBest wishes\n\nEssam bukhari\n\n', '162.158.95.22', '2015-09-28 16:04:13', '1', '', ''),
