(915, 'Essam Bukhari', 'ahmadbukhari1991.ab@gmail.com', 'Late visa', '<div>Dear<b>&nbsp;</b><b>Essam Bukhari,</b></div><div><br></div><div>Thank you for contacting <b>Quickevisa.com</b></div><div><br></div><div>We are sorry that we are unable to help you at this point in time, your record is not held on our system and we have to conclude that you never applied via <b>Quickevisa.com <br></b></div><div><br></div><div>Please be advised from the email in which you have just sent to us, we can advise you that you have processed your e-visa application from an <b>alternative website provider which is not affiliated to us.</b>&nbsp; I kindly suggest&nbsp; that you contact them directly and ask for clarification / refund / cancellation notification.<br><br></div><div>We hope we have done our best to support you on this occasion.</div><div><br></div><div>Thank you for contacting <b>Quickevisa.com</b> Support Team,<br></div><div><br></div>', '', '2015-09-28 19:43:28', '', '1', ''),
