(922, 'Kenneth James Fletcher', 'kjfletcher1@gmail.com', 'Incorrect information on Turkish Visa', 'My Canadian Passport Number is QI 296209\nThe Turkish Travel Document box has Q1 29609\nI believe that I entered the correct number for the visa.\nMy reference Invoice ID:QV-55FF871C337D7\nSincerely hoping that you can correct this error.\nThank You\nJames Fletcher', '174.6.111.163', '2015-09-28 20:15:12', '1', '', ''),
(923, 'Kenneth James Fletcher', 'kjfletcher1@gmail.com', 'Incorrect information on Turkish Visa', 'Dear&nbsp;<b>Kenneth James Fletcher,<br></b><span><br>I\r\nhope that this email finds you having a nice day.<br></span><span><br>Your\r\napplication reference number :&nbsp;</span><b>QV-55FF871C337D7<br></b><br>Please check once again that The Turkey Visa is also showing same passport number(QI296209) which you are given saying the correct one .<br><b><br>Download and Re-check&nbsp;your Turkey visa here :</b><b>&nbsp;<a href="https://quickevisa.com/application/download-evisa/QV-55FF871C337D7" target="" rel="">https://quickevisa.com/application/download-evisa/QV-55FF871C337D7</a><br></b><span><br>We wish you a safe onward\r\njourney, enjoy your visit to Turkey.</span><b><br><br><br><br><br><br></b>', '', '2015-09-28 21:29:37', '', '1', ''),
(924, 'Hussa', 'hussa.always@gmail.com', 'Additional email after e-Visa sent -5% Spam coverage (ET301G)', '<div>Dear<b>&nbsp;Hussa Abdullah </b><b>Alshathry ,</b> </div><div><br></div><div>I hope that this email finds you having a nice day. It was nice speaking with you over phone.<br><br>As per your request the Middle name has been added to Hussa <b>Abdullah </b>Alshathry e-Visa. A new e-Visa has been issued.<br><br></div><div>Your application reference number: QV-560992EA0B1C8</div><div><br></div><div>Your eVisa has already been sent to your email.</div><div><br></div><div>Just in case you did not receive any email, you are kindly requested to check your spam folder.</div><div><br></div><div>However to save time, please follow the below secured and encrypted link to download your e-Visa directly.</div><div><br></div><div>Download Link <b>:&nbsp;</b><b><a rel="" target="" href="https://quickevisa.com/index.php/application/download-evisa/QV-560992EA0B1C8">https://quickevisa.com/index.php/application/download-evisa/QV-560992EA0B1C8</a><br><br></b></div><div>Thank you for selecting our e-application support service, we would be very happy to serve you again in the near future.</div><div><br></div><div>Your copy of eVisa will be held within a secured system at Quickevisa in case you have lost your copy, please feel free to contact us via info@quickevisa.com quoting your reference number, we should be able to retrieve a copy and send out to you within 24 hours.</div><div><br>Please Note: <b>Mashael abdullah z alshethri </b>and <b>Hussa Abdullah Alshathry </b>can travel to Turkey from 1 November 2015&nbsp;&nbsp; to any time until the expiry of e-Visa,&nbsp; which is 28th April 2016.&nbsp; <br><br></div><div>We wish you a safe onward journey, enjoy your visit to Turkey.</div><br>', '', '2015-09-28 23:07:12', '', '1', '1625'),
