(940, 'Jennifer Jane', 'youngfootes@aol.com', 'Turkey Quick eVisa - Some information missing to process your eVisa', '<div>Dear Jennifer Jane,</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: QV-560A90686CAD3</div><div><br></div><div>Please be advised that Quickevisa.com is pending update from you in line with <b>Your arrival date</b>. It&nbsp;should be <b>within 3 months</b> as of the date of an e-Visa application.&nbsp;please can you please <b>change the travel date and&nbsp;confirm to us.</b></div><div><br></div><div><span>Please kindly reply back to us via <a href="https://quickevisa.com/contact-us" target="" rel="">https://quickevisa.com/contact-us</a> quoting\r\nyour reference number.</span></div><div><br></div><div>Please note: you donâ€™t have to make fresh application; your email confirmation of the changes will be added to the application with your full authorization.</div><div><br></div>', '', '2015-09-29 14:37:02', '', '1', '1654'),
(941, 'Abdelaty  Bedir', 'abdelatybedeir@gmail.com', 'Work Visa ', 'Hello \nThis Abdelaty Bedir from Egypt. I have applied for a work visa from the Turkish Embassy in Cairo and it is ready to be printed on my passport.  However, I was on Hajj"pilgrimage in Saudi Arabia and was injured in the last accidents. Can I get the Visa through the Turkish Embassy in Saudi Arabia and travel Directly to Turkey?\nPlease. If there is a way, can you help me on that matter?\nRegards', '141.101.105.60', '2015-09-29 13:51:28', '1', '', ''),
