(945, 'Sheila Holroyd', 'sheila.holroyd@ic24.net', 'Visa applications QPR ERG, X52 M8AS', 'I am applying for evisas for myself and my husband. The applications are approved but when I try to pay the security number is often automatically replaced with the date and I cannot delete the date given to insert the expiry date. Ia there any other way I can pay apart from this extremely annoying eform?', '87.113.174.9', '2015-09-29 15:08:46', '1', '', ''),
