(952, 'Steve Steve', 'steve@no.replyhere.com', 'inquiry', 'Google''s latest algorithm update now ranks your site higher based on your social media popularity. Boost your social media popularity, boost your position in Google''s results - buy likes, shares and followers from REAL and active users for virtually any social media platform. What''s the point buying these when you can get them organically?  Do you think you have enough likes, shares and followers to compete against the big guys? Yep, that''s what we thought. Well that''s about to change, now you can and starting at only $35. Check out our site: http://goo.gl/oAVFxU\n\nThanks for your time!\n\nSteve', '208.73.207.163', '2015-09-29 21:28:13', '1', '', ''),
