(954, 'Majed Omar', 'magid_o@hotmail.com', 'visa for Yamini ', '<div>Dear&nbsp;Majed Omar,</div><div><br></div><div>Hope you are having nice day.</div><div><br></div><div>Thank you for contacting us.</div><div><br></div><div>To check your eligibility please make application following this link, the application process is designed to check your eligibility. <a href="http://quickevisa.com/application" target="" rel="">http://quickevisa.com/application</a>&nbsp;</div><div><br></div><div>For the fee and other information please visit <a href="http://quickevisa.com/visa-fees" target="" rel="">http://quickevisa.com/visa-fees</a>&nbsp;</div><div><br></div><div>If you wish to contact us, please do not reply to this message but instead go to <a href="https://quickevisa.com/contact-us" target="" rel="">https://quickevisa.com/contact-us</a></div><div><br></div>', '', '2015-09-29 22:35:43', '', '1', ''),
(955, 'Umar  Farooq', 'umer_kuwait@yahoo.com', 'Eligibility for Pakistani National to apply for E-Visa', 'Good Morning Sir;\n                             I am a Pakistani National, Working as a teacher in Kuwait. \nI want to apply visa for my holidays visit to Turkey. \n\nPakistani national are allowed to apply on-line or I have to apply manually to the Turkish Embassy, Kuwait.\n\nRegards\n\nUmar Farooq\n\n', '83.96.72.24', '2015-09-30 07:29:53', '1', '', ''),
(956, 'muath nathif', 'muathna91@gmail.com', 'e visa', 'I apply for a visa,and it shows that it will take one business day to issue it, but till now i didn''t receive it. may I know why its took all that time? I did apply for it before, but it doesn''t took this much time\nthank you. ', '162.158.94.100', '2015-09-30 07:30:29', '1', '', ''),
(957, 'muath nathif', 'muathna91@gmail.com', 'e visa', '<div>Dear <b>muath nathif,</b></div><div><br></div><div>Thank you for contacting <b>quickevisa.com</b> support team.<br></div><div><br></div><div>Quickevisa.com searched our data base using your email id which you have used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1. <b>Quickevisa.com reference number</b>: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our 15 digits reference number normally start with <b>(QV-XXXXXXXXXXXXX) in the front.</b></div><div><br></div><div>2. In addition to that reference number you can also provide us with your<b> passport number</b> you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the<b> email id used whilst applying</b> for the service.</div><div><br></div><div>4. <b>Payment confirmation</b> which has been confirmed by Quickevisa.com</div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.</div>', '', '2015-09-30 08:32:48', '', '1', ''),
(958, 'Umar  Farooq', 'umer_kuwait@yahoo.com', 'Eligibility for Pakistani National to apply for E-Visa', '<div>Dear Umar  Farooq,</div><div><br></div><div>Hope you are having nice day.</div><div><br></div><div>Thank you for contacting us.</div><div><br></div><div>To check your eligibility please make application following this link, the application process is designed to check your eligibility. <a href="http://quickevisa.com/application" target="" rel="">http://quickevisa.com/application</a>&nbsp;</div><div><br></div><div>For the fee and other information please visit <a href="http://quickevisa.com/visa-fees" target="" rel="">http://quickevisa.com/visa-fees</a>&nbsp;</div><div><br></div><div>If you wish to contact us, please do not reply to this message but instead go to <a href="https://quickevisa.com/contact-us" target="" rel="">https://quickevisa.com/contact-us</a></div><div><br></div>', '', '2015-09-30 08:33:24', '', '1', ''),
