(960, 'Ahmed Adel Abdelwahed', 'aadel_hassan52@yahoo.com', 'Visa Charge', 'Dear Sir,\n\nI''m a frequent visitor of Turkey. For several occasions that i applied for a visa to Turkey i was only charged USD 20 being an Egyptian. Yesterday, I again applied for an online visa to Turkey for my next travel but i was surprised to be charge USD 199.\n\nI would like to ask if that is the current rate for a single entry visa or for a multiple entry visa which i''m not applying for.\n\nMay I ask for a refund if I was wrongly charged. \n\nMy passport number is A16024898.\n\nThank you very much for assistance.', '162.158.11.162', '2015-09-30 07:46:03', '1', '', ''),
(961, 'muath nathif', 'muathna91@gmail.com', 'e visa', '<div>Dear muath nathif,</div><div><br></div><div>Thank you for contacting Quickevisa.com</div><div><br></div><div>We are sorry that we are unable to help you at this point in time, your record is not held on our system, and we have to conclude that you never applied via quickevisa.com.</div><div><br></div><div>Please be noted from that email you have just sent to us now, we can note that you have processed your visa from different website because our reference number will be like this&nbsp;&nbsp;<b>QV-XXXXXXXXXXXXXX </b>but order number which you sent us&nbsp;<span><b>cd12668871 </b>does not belongs to us</span>. I kindly suggest you to contact them directly and ask for clarification/refund/Cancelation.</div><div><br></div><div>We hope we have done our best to support you at this occasion.</div><div><br></div><div>Thank you for contacting us.</div><div><br></div><div><br></div>', '', '2015-09-30 08:53:22', '', '1', ''),
(962, 'Ahmed Adel Abdelwahed', 'aadel_hassan52@yahoo.com', 'Visa Charge', '<div>Dear <b>Ahmed Adel Abdelwahed,</b></div><div><br></div><div>Thank you for contacting <b>quickevisa.com</b> support team.<br></div><div><br></div><div>Quickevisa.com searched our data base using your email id which you have used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1. <b>Quickevisa.com reference number</b>: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our 15 digits reference number normally start with <b>(QV-XXXXXXXXXXXXX) in the front.</b></div><div><br></div><div>2. In addition to that reference number you can also provide us with your<b> passport number</b> you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the<b> email id used whilst applying</b> for the service.</div><div><br></div><div>4. <b>Payment confirmation</b> which has been confirmed by Quickevisa.com</div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.</div>', '', '2015-09-30 09:06:33', '', '1', ''),
