(979, 'Jennifer Jane Young ', 'youngfootes@aol.com', 'Turkey Quick eVisa -  Your arrival date should be within 3 months', '<div>Dear Jennifer Jane Young,</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: QV-560A90686CAD3</div><div><br></div><div>Please be advised that <b>Quickevisa.com</b> is pending an&nbsp;update from you in line with&nbsp;<b>Your arrival date</b>. It&nbsp;should be applied as close to the departure date as possible as for example the visa is only having&nbsp;<b>180 days validity</b>&nbsp;as of the date of an e-Visa application is processed/allocated.<br><br>In the case that we processed&nbsp;the evisa from the date of your application&nbsp;then the validity period would have it&nbsp;expiring Dec 27 2015 for example. Please can you advise us of the departure date as on your original application it notes 2017 with a month range outside of the 180 days if processed now. <b>Quickevisa.com </b>can allocate a refund or alternatively&nbsp;process it closer to the time of your departure and hold the application&nbsp;within our system if authorised by yourself in writing.</div><div><br></div><div><span>Please kindly reply back to us via&nbsp;<a href="https://quickevisa.com/contact-us" target="" rel="">https://quickevisa.com/contact-us</a>&nbsp;quoting your reference number.</span></div><div><br></div><div>Please note: you do not have to make a&nbsp;fresh application; your email confirmation of the changes will be added to the application with your full authorisation.</div><br>', '', '2015-09-30 17:57:57', '', '1', '1654'),
