(990, 'Abdullah Kanhal', 'alkanhalabdullah@yahoo.com', 'Urgent process to visa', '<div>Dear <b>Abdullah Kanhal,</b></div><div><br></div><div>Thank you for contacting <b>quickevisa.com</b> support team.<br></div><div><br></div><div>Quickevisa.com searched our data base using your email id which you have used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1. <b>Quickevisa.com reference number</b>: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our 15 digits reference number normally start with <b>(QV-XXXXXXXXXXXXX) in the front.</b></div><div><br></div><div>2. In addition to that reference number you can also provide us with your<b> passport number</b> you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the<b> email id used whilst applying</b> for the service.</div><div><br></div><div>4. <b>Payment confirmation</b> which has been confirmed by Quickevisa.com</div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.</div>', '', '2015-10-02 15:12:14', '', '1', ''),
