(1001, 'Gulshad Hasan', 'gulshad_hassan@hotmail.com', 'Turkish Visa application, to participate in the conference as speaker.', 'I am at present Working in Saudi Arabia as Consultant Endocrinology, at King Abdullah Medical city Hospital, Makkah Saudi Arabia. I am a Pakistani National. Can I apply e visa on line to participate in the Endocrinology Conference, Endo Bridge,2015,Antalya Turkey, 15-18th October, 2015.\nRegards,\nDr Gulshad Hadan\nFRCP(London)', '162.158.94.110', '2015-10-03 08:02:08', '1', '', ''),
(1002, 'Ricardo ', 'rstvil2101@gmail.com', 'Turkey Quick eVisa - Some information required to process your eVisa', '<div>Dear Ricardo ,</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number:<b> QV-560A0AA0489EE and received payment from PayPal today.<br></b></div><div><br></div><div>Can you please confirm Turkey travel dates? so that we will process your visa now.</div><div><br></div><div>If you are looking for more help or have a question to ask click here and share <a rel="" target="" href="https://quickevisa.com/contact-us">https://quickevisa.com/contact-us</a> quoting your reference number and the name.</div><div><br></div><div>Please note: you do not have to make fresh application; your email confirmation of the changes will be added to the application with your full authorization.</div>', '', '2015-10-03 11:26:21', '', '1', '1636'),
(1003, 'Abdulla Aljassim ', 'abdullaaljassim@hotmail.com', 'cancel application reference: e48991ffa', 'Can you please cancel appreciate reference for the e-visa and refund amont in my account \nThank you ', '162.158.11.176', '2015-10-03 16:57:28', '1', '', ''),
(1004, 'Abdulla Al Jassim', 'Abdullaaljassim@hotmail.com', 'Refund request', 'Wish to advise you that application Number e48991ff5a was not ready upon my arrival to istanbul and I had to make upon arrival visa for me and my family. I would appreciate if you can consider refunding the total amount back to my account since the visa application will not be needed any more.', '162.158.11.170', '2015-10-03 17:18:52', '1', '', ''),
