(1006, 'khalid', 'kak35000@hotmail.com', 'Turkey Quick eVisa -  Your arrival date should be on or before 01.11.2015', '<div>Dear khalid,</div><div><br></div><div>I hope that this email finds you having a nice day.</div><div><br></div><div>Your application reference number: QV-56104634EFF8E</div><div><br></div><div>Please be advised that Quickevisa.com is pending update from you in line with&nbsp;<b>Your arrival date</b>. It&nbsp;should be&nbsp;<b>on or before 01.11.2015&nbsp;</b>the date of an e-Visa application.&nbsp;please can you please&nbsp;<b>change the travel date and&nbsp;confirm to us.</b></div><div><br></div><div><span>Please kindly reply back to us via&nbsp;<a href="https://quickevisa.com/contact-us" target="" rel="">https://quickevisa.com/contact-us</a>&nbsp;quoting your reference number.</span></div><div><br></div><div>Please note: you do not have to make fresh application; your email confirmation of the changes will be added to the application with your full authorization.</div><br>', '', '2015-10-04 05:47:09', '', '1', '1682'),
