PayPal- you&nbsp;have a full&nbsp;refund as per below.</span></span></div><span><br>Sent to:<br>Khalid Almemari&nbsp;</span><span>Email:<br>kak35000@hotmail.com</span><span>Total amount:<br>-$556.00 USD</span>Fee amount:<br><span>Invoice ID:<br>QV-56104634EFF8E</span><span>Date:<br>4 Oct 2015</span><span>Time:<br>10:50:35 BST</span><span>Status:&nbsp;<br>Completed</span><br><span>Subject:<br><div>You have sent <b>$556.00 </b>USD to Khalid Almemari with PayPal</div></span><span>Note:<br><div>Customer travel dates exceed the processing window for application, customer was offered a refund and accepted - will reapply closer to travel date</div></span></span></div><div><br></div><div>In the meantime, should you change your mind please do not hesitate to contact us via <a href="https://quickevisa.com/contact-us" target="" rel="">https://quickevisa.com/contact-us</a> quoting your reference number and the name and we will happily process closer to the date of departure to make sure your e-visa is valid for your length of stay.</div><div><br>Please note: you do not have to worry, the refund has been&nbsp;actioned promptly. &nbsp;We always seek to ensure that our customers are looked after on time.<br><br>Please feel free to apply via <b>Quickevisa.com </b>closer to the time of travel. We advised as per telephone conversation to apply on Nov 1 if you are travelling Dec 20 2015 as the e-visa is valid for a period of 180 days.</div><div><br></div>', '', '2015-10-04 11:01:32', '', '1', '1682'),
(1013, 'essa obaid', 'topgear1@emirates.net.ae', 'visa decline', 'we apply a turkey online visa. But the visa get declined because of blank nationality Actually in online application form we mention nationality also. But still the visa get cancelled. Now we need the visa fees back.', '162.158.99.162', '2015-10-04 10:34:24', '1', '', ''),
(1014, 'essa obaid', 'topgear1@emirates.net.ae', 'visa decline', '<div>Dear <b>essa obaid,</b></div><div><br></div><div>Thank you for contacting <b>quickevisa.com</b> support team.<br></div><div><br></div><div>Quickevisa.com searched our data base using your email id which you have used to send this email. Unfortunately we are unable to locate your information.</div><div><br></div><div>For us to reply back to this query, please provide us the following information;</div><div><br></div><div>1. <b>Quickevisa.com reference number</b>: whilst applying for using quickevisa.com e-visa application support -digital service portal, you would have received an automated confirmation email with a reference number. Our 15 digits reference number normally start with <b>(QV-XXXXXXXXXXXXX) in the front.</b></div><div><br></div><div>2. In addition to that reference number you can also provide us with your<b> passport number</b> you might have used whilst applying.</div><div><br></div><div>3. Or you can provide us with the<b> email id used whilst applying</b> for the service.</div><div><br></div><div>4. <b>Payment confirmation</b> which has been confirmed by Quickevisa.com</div><div><br></div><div>We would require any of the above four sources of information for us to be able to trace your application and resolve your query immediately.</div><div><br></div><div>Please note normally all queries are answered within 24 hours.</div><div><br></div><div>Thank you for contacting us, please let us know the choice of data to be provided, as soon as possible in order for us to serve you better.</div>', '', '2015-10-04 11:39:07', '', '1', ''),
