(1037, 'Abdulaziz Almohammed', 'meshary001@yahoo.com', 'refused e visa', '<div>Dear Abdulaziz Almohammed,</div><div><br></div><div>Thank you for contacting Quickevisa.com</div><div><br></div><div>We are sorry that we are unable to help you at this point in time, your record is not held on our system, and we have to conclude that you never applied via quickevisa.com.</div><div><br></div><div>Please be noted from that email you have just sent to us now, we can note that you have processed your visa from different website xxxxxxxxx (this I the site information given by customer as reference for refund or cancelation or enquiry) and this website does not belong to us. I kindly suggest you to contact them directly and ask for clarification/refund/Cancelation.<br><br></div><div>You can talk to your credit card company then you can find out.<br><br></div><div>We hope we have done our best to support you at this occasion.</div><div><br></div><div>Thank you for contacting us.</div><div><br></div><div><br></div>', '', '2015-10-05 16:20:56', '', '1', ''),
