(1138, 'Wang  Liao', 'atomic@atomicproperties.org', 'request Update for Reference No: e3cd3afbe9', '<div>Dear <b>Wang  Liao,</b></div><div><br></div><div>Thank you for contacting <b>quickevisa.com</b> support team.<br></div><br><div>For us to reply back to this query, please provide what is the website address ( URL ) which you was applied which is very must?<br><br><div>Quickevisa.com searched our data base using your \r\nemail id which you have used to send this email. Unfortunately we are \r\nunable to locate your information.</div></div><br>', '', '2015-10-26 06:54:47', '', '1', ''),
(1139, 'Leonard Leonard', 'lenny@buylikesandshares.win', 'follow up', 'if you have only 32 Facebook fan page likes, you won''t seem very popular to the next person that lands on your page. This will result in low trust and low sales, but the benefits don’t stop there: if you have very few likes, your fan page will also have a hard time ranking in search engines such as Google, Bing, Yahoo, and even Facebook’s search itself. This means very few people will be able to find your fan page at all, let alone know whether or not it has a lot of likes. Let me help you fix that problem now: http://www.boostsocial.win\n\nThank you for your time!\n\nLeonard', '173.214.169.183', '2015-11-07 07:50:13', '', '', ''),
(1140, 'Donna Donna', 'mrfrmooog@xhkss.net', 'Donna', 'Hi my name is Donna and I just wanted to drop you a quick note here instead of calling you. I discovered your Quick Turkey Visa - individual and Group visa in 30 minutes page and noticed you could have a lot more traffic. I have found that the key to running a successful website is making sure the visitors you are getting are interested in your niche. There is a company that you can get targeted visitors from and they let you try their service for free for 7 days. I managed to get over 300 targeted visitors to day to my site. Visit them here: http://garye.co/s6', '172.245.120.66', '2015-11-13 08:31:07', '', '', ''),
(1141, 'James James', 'james@buylikesandshares.win', 'help', 'The fact is that the more popular you seem on social media the better your sales will be. But that''s not the only benefit, if you have very few likes your social media page will also encounter difficulty ranking in search engines such as Google, Bing, Yahoo, and even Facebook’s search itself. This means very few people will be able to find your social media page at all, let alone know whether or not it has a lot of likes. I would like to help you solve that problem now: http://buylikesandshares.win\n\nThank you for your time!\n\nJames', '173.214.169.170', '2015-11-14 08:17:49', '', '', ''),
(1142, 'Nick Nick', 'sales@zeddindex-canada.com', 'website optimization', 'Hi, my name is Nick and I wanted to offer my services as a web developer. We charge a low flat rate for all projects, no surprises or hidden costs. Here are just a few of the things we can do for you:\n\n* Convert your static HTML website into WordPress format, add a blog section and optimize on-page seo. WordPress format allows you to modify your website content by yourself without the need for a web designer - keep your site current without being held hostage by your designer. Price: $299\n\n* Create a new 5 page website in WordPress format including a blog section, optimize on-page seo so you will rank higher in search engines: Price $399 - Add ecommerce for $99 extra.\n\nOfcourse this is just a very small example of the things we are capable of. You can see more of our work here: zeddindex-canada.com\n\nPlease reply if you would like us to quote you on a more specific job or if you would like to order one of the flat rate packages mentioned above.\n\nNick.', '162.246.17.122', '2015-11-17 00:13:03', '', '', ''),
(1143, 'Barb Barb', 'barb37dfh387@gmail.com', 'your facebook page', 'Hi my name is Barb and I was wondering if you have a Facebook page. If you do, your content is likely to go more viral or popular if you already have an established fan base and buy likes from us. Most people are sheep and they like to follow what’s buzzing. A strategy which includes buying likes will in time turn your fan base into a consistent marketing power house. Get yours here: http://goo.gl/Ufd7yr\n\nThanks\n\nBarb.', '173.214.169.170', '2015-11-17 00:50:01', '', '', ''),
