(1147, 'Abdul Rasheed', 'raashid123123@rediffmail.com', 'Enquiry for visa ', 'Dear Sir,\n\nI am planning to get tourist visa to Turkey to my family which includes myself,my wife and child.However only myself have multiple visa for 10 years for United States of America on my Passport.So I need to enquire if I require tourist visa or not to travel to Turkey and also wanted to confirm the same to my spouse and child if they require tourist visa as they do not multiple visa for United States of America.And also wanted to know how much time it will take if I apply online to get tourist Visa.\nWaiting for your response ASAP.\n\n\n\nRegards,\nAbdul.', '198.41.232.35', '2015-11-21 08:20:54', '', '', ''),
(1148, 'xiaohui  sui', 'mariamwazzan.sui@gmail.com', 'searching for my e-visa', 'i got an e-mail about my e-visa as followed\nGeneral Information\nORDER NO	:	eb33d22de1\nORDER Date	:	21.11.2015 13:14\nStatus	:	Completed\nTotal Cost	:	$199\nNationality	:	CHINA (CHN)\nNumber Of Applicants	:	1\nSpecify Travel Document	:	Ordinary Passport\nTravel Date	:	29.11.2015\nEmail Adress	:	mariamwazzan.sui@gmail.com\nTelephone Number	:	+971561147080\nAdress	:	UAE, Dubai, Mirdif, Street 67B, Villa # 4\nPayment Information\nPayment Status	:	Payment Completed  \nPayment Method	:	Credit Card\n\nuntil today i haven''t received any e-mail of my e-visa,please tell me what to do.\nthank you\n', '162.158.98.84', '2015-11-22 14:43:56', '1', '', ''),
(1149, 'Mohamed Nawas Mohamed Farook', 'mnawaz@gasco.ae', 'Obtaining Visa For Turkey for Medical Purpose', 'I need to get an urgent Visit Visa for Turkey that I have to travel by 27th November, 2015.\n\nI am a Sri Lankan National.\nI already have valid US Visa stamped in my passport and Schegen Visa (which is expired).\nI have a residence in the UAE (Work here in an Oil and Gas Company).\n\nAppreciate your support. ', '162.158.99.151', '2015-11-23 06:58:29', '', '', ''),
