(1151, 'Sandra Sandra', 'aankywckhko@udkdoles.net', 'Sandra', 'Hi my name is Sandra and I just wanted to drop you a quick note here instead of calling you. I discovered your Quick Turkey Visa - individual and Group visa in 30 minutes page and noticed you could have a lot more visitors. I have found that the key to running a popular website is making sure the visitors you are getting are interested in your subject matter. There is a company that you can get targeted traffic from and they let you try the service for free for 7 days. I managed to get over 300 targeted visitors to day to my website. Check it out here: http://tgi.link/dcf2', '107.173.160.6', '2015-12-02 13:07:33', '', '', ''),
(1152, 'jenn jenn', 'jenn481_frr@hotmail.com', 'social media', 'Hi my name is Jenn and I was just at your site looking to see if you had any social media accounts. If you do, I can help you make them more popular. For example whenever people are deciding to follow you on Twitter or Facebook, they will always look first to see how many followers or likes you already have. The more you have, the more popular you seem thereby attracting more organic likes and followers who are in your target demographic. Think of buying social media popularity like a giant magnet that attracts more of what you need. Check out my site and make your popularity appear to be crazy: http://goo.gl/1eirfo', '173.214.169.183', '2015-12-10 10:22:55', '', '', ''),
