(1158, 'Kamran Bagirov', 'ai4ever3@gmail.com', 'Wrong Visa', 'Hello, few month back, to be exact on september 3rd i got visa fro you guys and i had some issuers with my payment than one guy called and try to help me,. and i specificaly told him i do have travel document not full passport and would this evisa still be acceptable. he said yes and i end up sent back right as soon as i land. I paid for that visa 160$ . and when i wrote noone respond. Here i am again weriting regarding refund. Hope to hear back from you this time. cheers', '108.162.245.191', '2016-01-14 04:17:46', '1', '', ''),
(1159, 'Mark', 'markturnz@gmail.com', 'EDIT : Turkey Quick eVisa - Client accepted offer but Asking for change to all the application to re issue eVisa ', '<div>Dear&nbsp;Mark&nbsp;</div><div><br></div><div>Thank you for contacting us again.</div><div><br></div><div>Old Application Reference: QV-55DAC29713048</div><div>New Application Reference:&nbsp;,QV-5961D4CE7E810&nbsp;</div><div><br></div><div>It is also noted that you have applied with new Arrival date for both 20.09.2015</div><div><br></div><div>Please be noted that previously issued visa for Mr KHALID AHMED B BAGEDO, Passport Number: L680720is &nbsp;valid, &nbsp;itâ€™s not compulsory that he must travel on the arrival date mentioned on his visa which is 27.08.2015. &nbsp;Mr KHALID AHMED B BAGEDO, can use his existing eVisa to travel within his validity period which is 22 February 2016.( this date available at the eVisa &nbsp;which is issued)</div><div><br></div><div><br></div><div>As we have mentioned in the previous email, we are happy to issue new eVisa for AMRO KHALID A &nbsp;BAGEDO, Passport Number K653588. He will have is validity starting from 20 September 2015.</div><div><br></div><div>Kindly confirm this email, we will go ahead and issue new eVisa for Mr AMRO KHALID A &nbsp;BAGEDO, Passport Number K653588. &nbsp;We will do this process free of charge as we have offered in our previous email.</div><div><br></div>', '', '2017-07-09 03:16:29', '', '1', '1715'),
